INSERT INTO `book_episode` VALUES ('17', '第 1 章　客户端/服务器网络编程简介', '1', null, '88', '1', 'html', '<p>本书将带领读者使用Python语言探索网络编程。全书涵盖了网络编程的基本概念、模块以及第三方库，这些第三方库在使用流行互联网通信协议与远程机器进行通信时可能会用到。</p>\n\n<p>本书并不适用于未使用过Python语言甚至未编写过计算机程序的读者，因为书中并不教授如何使用Python语言进行编程。本书假设读者已经通过相关资料对Python编程有所了解。我希望书中的Python示例能够帮助读者了解如何组织并编写自己的代码，但我会不加解释地大量使用各种高级的Python特性。不过，在遇到一些我认为尤其有趣或巧妙的用法时，我也会指出并加以说明。</p>\n\n<p>另一方面，本书并不预设读者有任何网络知识！只要使用过浏览器或者发送过电子邮件，就完全可以从头开始阅读本书并循序渐进地学习计算机网络。本书会从应用开发者的角度来介绍网络：一是从实现一个网络连接服务的角度，例如网站、邮箱服务器或者网络游戏；二是从编写使用服务的客户端程序的角度。</p>\n\n<p>然而，需要注意的是，本书并不教授如何建立或配置网络。网络设计、服务器管理以及自动化配置都是内容丰富的主题，并且与本书涉及的计算机编程内容没有重复。随着在OpenStack、SaltStack和Ansible中的大量应用，Python确实已经在自动化配置领域得到了广泛的应用。尽管如此，如果读者想深入学习配置运维相关的技术，还是应该寻找专门介绍这方面技术的书籍和文档。</p>\n\n<h2>1.1　基础：协议栈与库</h2>\n\n<p>在学习Python网络编程的过程中，会不断遇到以下两个概念。</p>\n\n<ul>\n	<li><strong>协议栈</strong>（protocol stack）。复杂的网络服务建立在简单网络服务的基础之上。</li>\n	<li>经常需要使用之前编写过的Python<strong>库</strong>（library），包括Python内置的标准库以及下载安装的第三方库，来解析要使用的网络通信协议。</li>\n</ul>\n\n<p>很多情况下，网络编程就是选择并使用一个已经支持所需网络操作的库的过程。本书的主要目的就是向读者介绍Python的一些重要网络库，并讲解这些网络库所使用的底层网络服务。通过了解底层知识，除了可以理解网络库的运行原理外，还能够在底层部分出现错误时知道具体发生了什么，因此对读者是大有裨益的。</p>\n\n<p>让我们从一个简单的例子开始。下面是一个邮箱地址：</p>\n\n<pre>\n<code>207 N. Defiance St\nArchbold, OH</code></pre>\n\n<p>假设我们想知道该物理地址的纬度和经度。谷歌提供的地理编码API就能够完成这种从物理地址到经纬度的转化。那么如何通过Python来使用这个网络服务呢？</p>\n\n<p>想要使用一个全新的网络服务时，总是可以先查找一下是否有人已经实现了这个服务的通信协议。在本例中，所需要使用的是谷歌地理编码协议（Google Geocoding protocol）。因此可以先查阅Python的标准库文档，看看有没有与地理编码有关的内容。</p>\n\n<p><a href=\"http://docs.python.org/3/library/\">http://docs.python.org/3/library/</a></p>\n\n<p>读者查询到有关地理编码的库了吗？我也没有找到。尽管如此，经常查阅标准库目录对于Python程序员来说还是非常重要的，因为每次查询都可以加深对Python提供的服务的了解。Doug Hellmann的博客&ldquo;Python Module of the Week&rdquo;是另一个极佳的参考资料，读者也可以从中了解Python标准库提供的功能。</p>\n\n<p>由于标准库没有提供用于本例的包，因此我们可以查询Python包索引（Python Package Index）。这是一个相当优质的资源，可以从中找到全球各地的程序员和机构贡献的各种通用包。读者也同样可以通过所用服务提供商的网站查看其是否提供Python库的接口。除此之外，还可以直接用Python加上要使用的网络服务名称作为关键字，在谷歌上搜索，看看搜索结果中的前几个链接是否值得一试。</p>\n\n<p>在本例中，我搜索了Python Package Index，找到如下链接：</p>\n\n<p><a href=\"https://pypi.python.org/\">https://pypi.python.org/</a></p>\n\n<p>然后搜索geocoding，很快就找到了一个叫作pygeocoder的包，这个包提供了简洁的接口来获取谷歌的地理编码服务。（尽管从包名可以注意到，这个包<strong>并非</strong>由谷歌官方提供，而是第三方开发者开发的。）</p>\n\n<p><a href=\"http://pypi.python.org/pypi/pygeocoder/\">http://pypi.python.org/pypi/pygeocoder/</a></p>\n\n<p>正常情况下，开发者都能找到一个看上去完全满足需求的Python包并想试一试。我要在这里暂停一下，向读者介绍一个用来尝试新Python库的最棒的技术：virtualenv！</p>\n\n<p>以前，Python包的安装令人厌恶，并且不可逆。安装过程要求管理员权限，因此永久性地修改了系统的Python安装环境。经过了几个月的大规模Python开发，系统的Python包安装目录下就包含了大量的无用包，这些包均通过手动安装。更悲剧的是，一些新安装的包可能由于与已安装的包不兼容而无法使用。要知道，使用这些已安装包的项目在几个月前就已结束。</p>\n\n<p>而现在，谨慎的Python程序员再也不会遭这种罪了。通常来说，只要在系统层面上安装一个Python包就够了，那就是virtualenv！只要安装了virtualenv，就可以创建任意数量的小型、独立的&ldquo;虚拟Python环境&rdquo;。如果想要做实验的话，可以在这些&ldquo;虚拟Python环境&rdquo;中安装或卸载相应的包。这很好地保护了系统Python环境。当一个特定的项目或实验结束之后，只需删除对应的虚拟环境目录即可。过程简单，系统也能保持干净。</p>\n\n<p>在本例中，需要新建一个虚拟环境来测试pygeocoder包。如果读者之前从未在系统上安装过virtualenv，可访问下面的链接来下载并安装：</p>\n\n<p><a href=\"http://pypi.python.org/pypi/virtualenv\">http://pypi.python.org/pypi/virtualenv</a></p>\n\n<p>virtualenv安装完成后，便可使用如下命令来新建一个环境。（在Windows环境中，虚拟环境中包含Python二进制可执行文件的目录被命名为Scripts，而不是bin。）</p>\n\n<pre>\n<code>$ virtualenv &ndash;p python3 geo_env\n$ cd geo_env\n$ ls\nbin/ include/ lib/\n$ . bin/activate\n$ python -c &#39;import pygeocoder&#39;\nTraceback (most recent call last):\n  File &quot;&lt;string&gt;&quot;, line 1, in &lt;module&gt;\nImportError: No module named &#39;pygeocoder&#39;</code></pre>\n\n<p>由上可见，pygeocoder包尚未安装。由于运行了<code>activate</code>命令，新建的虚拟环境现在已经在系统路径中了，因此可在虚拟环境中使用<code>pip</code>命令安装pygeocoder包。</p>\n\n<pre>\n<code>$ pip install pygeocoder\nDownloading/unpacking pygeocoder\n  Downloading pygeocoder-1.2.1.1.tar.gz\n  Running setup.py egg_info for package pygeocoder\n\nDownloading/unpacking requests&gt;=1.0 (from pygeocoder)\n  Downloading requests-2.0.1.tar.gz (412kB): 412kB downloaded\n  Running setup.py egg_info for package requests\n\nInstalling collected packages: pygeocoder, requests\n  Running setup.py install for pygeocoder\n\n  Running setup.py install for requests\n\nSuccessfully installed pygeocoder requests\nCleaning up...</code></pre>\n\n<p>virtualenv中pygeocoder包的二进制可执行文件现在已经可以使用了。</p>\n\n<pre>\n<code>$ python -c &#39;import pygeocoder&#39;</code></pre>\n\n<p>安装了pygeocoder后，代码清单1-1所示的程序search1.py就可以运行了。</p>\n\n<blockquote>\n<p><strong>代码清单1-1</strong>　获取经度与纬度</p>\n</blockquote>\n\n<pre>\n<code>#!/usr/bin/env python3\n# Foundations of Python Network Programming, Third Edition\n# https://github.com/brandon-rhodes/fopnp/blob/m/py3/chapter01/search1.py\n\nfrom pygeocoder import Geocoder\n\nif __name__ == &#39;__main__&#39;:\n    address = &#39;207 N. Defiance St, Archbold, OH&#39;\n    print(Geocoder.geocode(address)[0].coordinates)</code></pre>\n\n<p>在命令行运行上述程序，可得到如下结果：</p>\n\n<pre>\n<code>$ python3 search1.py\n(41.521954, -84.306691)</code></pre>\n\n<p>看，屏幕上已经打印出了该地址的经纬度！这个结果是直接从谷歌的网络服务获取到的。我们的第一个示例程序成功了。</p>\n\n<p>通过上面的过程，你可能会觉得一本讲Python网络编程的书只是教你直接下载安装一个第三方包，然后把一个有趣的网络编程问题变成了3行无聊的Python脚本！你是不是觉得很不爽？淡定！你会发现90%的编程挑战就是这么解决的&mdash;&mdash;在Python社区中寻找其他已经解决你所面临问题的程序员，然后在他们的解决方案的基础上构建智能又简洁的方案。</p>\n\n<p>但是，本例还没彻底完成。我们已经展示了如何简单地获取复杂的网络服务，但是，优雅的pygeocoder接口背后的原理是怎样的呢？网络服务是如何工作的呢？下面，我们将详细学习如何在一个包含至少6层的网络协议栈的顶层构建这个复杂的服务。</p>\n\n<h2>1.2　应用层</h2>\n\n<p>第一个示例程序使用了一个从Python包索引下载的第三方Python库来解决问题。这个第三方库完整地包装处理了谷歌地理编码API。但如果没有这样的库怎么办呢？如果需要自己为谷歌地图API编写客户端又该怎么办呢？</p>\n\n<p>让我们通过代码清单1-2所示的search2.py来看看答案。这个程序没有使用直接提供地理编码功能的第三方库，而是使用了更底层的Requests库。Requests库相当流行，较pygeocoder更底层一些。从前面的<code>pip install</code>命令可以看出，Requests库也已经安装在虚拟环境中了。</p>\n\n<blockquote>\n<p><strong>代码清单1-2</strong>　从谷歌地理编码API获取一个JSON文档</p>\n</blockquote>\n\n<pre>\n<code>#!/usr/bin/env python3\n# Foundations of Python Network Programming, Third Edition\n# https://github.com/brandon-rhodes/fopnp/blob/m/py3/chapter01/search2.py\n\nimport requests\n\ndef geocode(address):\n    parameters = {&#39;address&#39;: address, &#39;sensor&#39;: &#39;false&#39;}\n    base = &#39;http://maps.googleapis.com/maps/api/geocode/json&#39;\n    response = requests.get(base, params=parameters)\n    answer = response.json()\n    print(answer[&#39;results&#39;][0][&#39;geometry&#39;][&#39;location&#39;])\n\nif __name__ == &#39;__main__&#39;:\n    geocode(&#39;207 N. Defiance St, Archbold, OH&#39;)</code></pre>\n\n<p>运行这段Python程序的返回结果与第一个脚本的结果颇为相似。</p>\n\n<pre>\n<code>$ python3 search2.py\n{&#39;lat&#39;: 41.521954, &#39;lng&#39;: -84.306691}</code></pre>\n\n<p>但可以看到，程序输出并非<strong>完全</strong>相同。例如，JSON数据将结果封装为一个&ldquo;对象&rdquo;，Requests库以Python字典的形式提供了该&ldquo;对象&rdquo;。但显而易见的是，这个脚本与第一个脚本基本完成了相同的功能。</p>\n\n<p>读者很容易注意到，本例中的代码并未像pygeocoder库一样提供更高层的地理编码语义。只有仔细分析这段代码才可能知道，其目的是查询一个邮寄地址对应的经纬度。在search1.py中，程序直接请求将地址转化为经纬度，而代码清单1-2则仔细地构造了一个基础URL以及一系列查询参数。程序编写者需要阅读过谷歌的文档才能清楚了解这些查询参数的意义。顺便提一下，如果想阅读该文档，可以从如下链接找到API描述：</p>\n\n<p><a href=\"http://code.google.com/apis/maps/documentation/geocoding/\">http://code.google.com/apis/maps/documentation/geocoding/</a></p>\n\n<p>仔细观察search2.py中的查询参数，可以发现，需要查询的邮寄地址是由名为<code>address</code>的参数标识的。另一个参数则向谷歌表明，该位置查询并非源于移动设备位置传感器提供的实时数据。</p>\n\n<p>接收到该URL查询的结果文档后，手动调用<code>response.json()</code>方法将结果转化为JSON格式，并通过Python字典的多层取值获取正确的经度和纬度。</p>\n\n<p>search2.py与search1.py完成的功能是相同的，不过区别在于，search2.py并没有通过地址和纬度这样的语义直接解决该问题，而是通过构造URL，获取查询响应，然后将结果转化为JSON，一步一步地解决了这个问题。这一区别在研究网络协议栈高层与底层协议时是相当常见的。高层的代码描述了查询的<strong>意义</strong>，而底层的代码则展示了查询的<strong>构造</strong>细节。</p>\n\n<h2>1.3　协议的使用</h2>\n\n<p>第二个例子的脚本构建了一个URL，并获取了该URL查询的响应文档。这一操作听上去相当简单。当然，为了使URL查询看起来像是一个基础操作，Web浏览器其实做了很多的工作。然而，URL之所以可以用来获取某个文档，真正原因显然是其描述了网络上该特定文档的位置以及获取方法。URL包含了协议的名称，后面跟着保存文档的主机名，最后是该主机上特定文档的路径。URL提供了更底层协议查询该文档所需的指令。这样一来，search2.py就能够解析URL并获取响应文档了。</p>\n\n<p>事实上，这个URL使用的底层协议就是著名的HTTP（Hypertext Transfer Protocol，超文本传输协议），HTTP协议几乎是所有现代网络通信的基础。在第9章、第10章和第11章中，读者将学到更多有关HTTP协议的知识。Requests库从谷歌获取结果的具体原理机制其实就是由HTTP提供的。如果不想使用Requests库提供的神奇功能，而是想直接使用HTTP来获取结果，又该怎么做呢？代码清单1-3所示的search3.py便是答案。</p>\n\n<blockquote>\n<p><strong>代码清单1-3</strong>　使用原始HTTP操作连接谷歌地图</p>\n</blockquote>\n\n<pre>\n<code>#!/usr/bin/env python3\n# Foundations of Python Network Programming, Third Edition\n# https://github.com/brandon-rhodes/fopnp/blob/m/py3/chapter01/search3.py\n\nimport http.client\nimport json\nfrom urllib.parse import quote_plus\n\nbase = &#39;/maps/api/geocode/json&#39;\n\ndef geocode(address):\n    path = &#39;{}?address={}&amp;sensor=false&#39;.format(base, quote_plus(address))\n    connection = http.client.HTTPConnection(&#39;maps.googleapis.com&#39;)\n    connection.request(&#39;GET&#39;, path)\n    rawreply = connection.getresponse().read()\n    reply = json.loads(rawreply.decode(&#39;utf-8&#39;))\n    print(reply[&#39;results&#39;][0][&#39;geometry&#39;][&#39;location&#39;])\n\nif __name__ == &#39;__main__&#39;:\n    geocode(&#39;207 N. Defiance St, Archbold, OH&#39;)</code></pre>\n\n<p>这个程序直接使用了HTTP协议。首先请求连接一台特定的主机，然后手动构造一个带<code>path</code>参数的<code>GET</code>查询，最后直接从HTTP连接读取响应结果。这种方法没有使用字典将查询参数方便地表示为独立的键值对，而是直接将它们手动嵌入到查询地址中。要通过这种方法完成查询，需要在问号（<code>?</code>）后跟上由<code>&amp;</code>分隔的参数。这些参数通过<code>name=value</code>的形式来表示。</p>\n\n<p>尽管方法不同，但程序运行的结果与前两个程序基本相同。</p>\n\n<pre>\n<code>$ python3 search3.py\n{&#39;lat&#39;: 41.521954, &#39;lng&#39;: -84.306691}</code></pre>\n\n<p>在阅读本书的过程中，读者会发现，HTTP只是Python标准库提供内置实现的众多协议之一。在search3.py中，毋需关心HTTP的实现细节，只需编写代码，简单地发送查询，然后查看相应结果即可。当然，这个程序需要处理的协议细节已经比search2.py更基础一些了，因为本例使用的协议比起前面的程序在协议栈中更低了一层。不过，至少仍然可以使用标准库来处理实际的网络数据，并保证其运行正确。</p>\n\n<h2>1.4　一个原始的网络会话</h2>\n\n<p>当然，HTTP是无法通过稀薄的空气在两台机器间传输数据的。HTTP协议必须使用一些更简单的抽象来完成操作。事实上，现代操作系统提供了使用TCP协议在IP网络的不同程序间进行纯文本网络会话的功能，而HTTP协议正是使用了这一功能。换句话说，HTTP协议精确描述了两台主机间通过TCP传输的信息格式，并以此提供HTTP的各项功能。</p>\n\n<p>如果继续深入观察HTTP的底层实现细节，那么你将到达通过Python可以方便操作的网络协议栈的最底层。仔细阅读代码清单1-4所示的search4.py，它向谷歌地图发起了与前三个程序相同的网络请求。不同的是，search4.py向网络发送了一个原始文本信息作为请求，并收到了很多原始文本作为响应。</p>\n\n<blockquote>\n<p><strong>代码清单1-4</strong>　直接使用套接字与谷歌地图通信</p>\n</blockquote>\n\n<pre>\n<code>#!/usr/bin/env python3\n# Foundations of Python Network Programming, Third Edition\n# https://github.com/brandon-rhodes/fopnp/blob/m/py3/chapter01/search4.py\n\nimport socket\nfrom urllib.parse import quote_plus\n\nrequest_text = &quot;&quot;&quot;\\\nGET /maps/api/geocode/json?address={}&amp;sensor=false HTTP/1.1\\r\\n\\\nHost: maps.google.com:80\\r\\n\\\nUser-Agent: search4.py (Foundations of Python Network Programming)\\r\\n\\\nConnection: close\\r\\n\\\n\\r\\n\\\n&quot;&quot;&quot;\n\ndef geocode(address):\n    sock = socket.socket()\n    sock.connect((&#39;maps.googleapis.com&#39;, 80))\n    request = request_text.format(quote_plus(address))\n    sock.sendall(request.encode(&#39;ascii&#39;))\n    raw_reply = b&#39;&#39;\n    while True:\n        more = sock.recv(4096)\n        if not more:\n            break\n        raw_reply += more\n    print(raw_reply.decode(&#39;utf-8&#39;))\n\nif __name__ == &#39;__main__&#39;:\n    geocode(&#39;207 N. Defiance St, Archbold, OH&#39;)</code></pre>\n\n<p>从search3.py到search4.py，有一个本质的不同。之前的3个程序各自都使用了一个Python库。Python的实现已经提供了这些库。我们可以使用这些库解析复杂的网络协议。而在本例中，我们已经深入到了最底层：使用主机操作系统提供的原始<code>socket()</code>函数来支持IP网络上的网络通信。换句话说，这种编写网络程序的方式和使用C语言的底层系统程序员所用的一样。</p>\n\n<p>在后面的几章中，读者将学习更多关于套接字的知识。目前可以从search4.py中观察到，原始网络通信的过程就是发送与接收字节串的过程。发送的查询是一个字节串，接收到的响应同样也是一个字节串。在本例中，我们将这个大型的响应字节串打印到屏幕。这样，读者就可以直观感受到底层操作的魅力了。（1.6节解释了为什么在打印前将字符串解码。）我们可以通过<code>sendall()</code>函数传入的参数了解到该HTTP查询的具体内容。能够看到，查询中包含了关键字<code>GET</code>（表示希望进行的操作的名称），<code>GET</code>后跟着待获取文档的路径以及支持的HTTP版本。</p>\n\n<pre>\n<code>GET /maps/api/geocode/json?address=207+N.+Defiance+St%2C+Archbold%2C+OH&amp;sensor=false HTTP/1.1</code></pre>\n\n<p><code>GET</code>信息后跟着一些请求头，每个请求头包含了名称、冒号、值。最后是表示请求结束的回车符和换行符。</p>\n\n<p>运行search4.py，查询的响应将会直接打印出来，如代码清单1-5所示。在本例中，我只是简单地将响应在屏幕上打印了出来，而没有编写复杂的文本处理代码来解析这一响应。这么做是因为，我认为阅读屏幕上打印出来的HTTP响应能够帮助读者更好地了解HTTP响应的形式。相比之下，要理解用于解析HTTP响应的代码就困难多了。</p>\n\n<blockquote>\n<p><strong>代码清单1-5</strong>　search4.py的运行输出</p>\n</blockquote>\n\n<pre>\n<code>HTTP/1.1 200 OK\nContent-Type: application/json; charset=UTF-8\nDate: Sat, 23 Nov 2013 18:34:30 GMT\nExpires: Sun, 24 Nov 2013 18:34:30 GMT\nCache-Control: public, max-age=86400\nVary: Accept-Language\nAccess-Control-Allow-Origin: *\nServer: mafe\nX-XSS-Protection: 1; mode=block\nX-Frame-Options: SAMEORIGIN\nAlternate-Protocol: 80:quic\nConnection: close\n\n{\n   &quot;results&quot; : [\n      {\n         ...\n         &quot;formatted_address&quot; : &quot;207 North Defiance Street, Archbold, OH 43502, USA&quot;,\n         &quot;geometry&quot; : {\n            &quot;location&quot; : {\n               &quot;lat&quot; : 41.521954,\n               &quot;lng&quot; : -84.306691\n            },\n            ...\n         },\n         &quot;types&quot; : [ &quot;street_address&quot; ]\n      }\n   ],\n   &quot;status&quot; : &quot;OK&quot;\n}</code></pre>\n\n<p>可以看到，HTTP响应的结构和HTTP请求相当类似。首先是状态行，然后跟着一些响应头。响应头后有一个空行，接着就是响应体。响应体是一个JavaScript数据结构，也就是JSON这一简单的格式。这个JSON就是之前查询的响应结果，描述了查询谷歌地理编码API返回的地理位置。</p>\n\n<p>当然，这里的所有状态和响应头事实上都是之前的程序中使用httplib库处理的底层细节。在本例中，可以看到，如果没有分层，那么网络通信的具体细节是什么样的。</p>\n\n<h2>1.5　层层深入</h2>\n\n<p>希望读者能够喜欢之前的几个Python网络编程的例子。这些例子展现了使用Python进行网络编程的一些要点。</p>\n\n<p>第一个要点，读者可能对<strong>协议栈</strong>这一术语有了更深的了解：先构建利用网络硬件在两台计算机之间传送文本字符串的原始对话功能，然后在此基础上创建更复杂、更高层、语义更丰富的对话（&ldquo;我想知道这个邮寄地址对应的地理位置&rdquo;）。</p>\n\n<p>在前面例子中分析过的协议栈包含4层。</p>\n\n<ul>\n	<li>最上层的谷歌地理编码API，对如何用URL表示地理信息查询和如何获取包含坐标信息的JSON数据进行了封装。</li>\n	<li>URL，标识了可通过HTTP获取的文档。</li>\n	<li>HTTP层，支持面向文档的命令（例如<code>GET</code>）。该层的操作使用了原始TCP/IP套接字。</li>\n	<li>TCP/IP套接字，只处理字节串的发送和接收。</li>\n</ul>\n\n<p>可以看到，协议栈的每一层都使用了其底层协议提供的功能，并同时向上层协议提供服务。这是第一点。</p>\n\n<p>通过这些例子说明的第二个要点是，Python对我们涉及的各网络层都提供了非常全面的支持。除非是要使用应用提供商定制的协议并定制请求的格式（如本例中使用pygeocoder连接谷歌服务），否则无需使用第三方库。我在第二个程序实例中选择使用Requests库，并非因为标准库缺少<code>urllib.request</code>模块，而是因为标准库提供的API太过时了。对于涉及的其他所有协议层，Python都内置了很强的支持。无论是要获取特定URL标识的文档，还是使用原始网络套接字来接收字符串，Python都提供了现成的函数和类来解决这些问题。</p>\n\n<p>第三点，注意到随着使用的通信协议越来越底层，程序的质量也明显随之下降。例如，search2.py和search3.py就对查询的表单结构和主机名等进行了硬编码。这样做使得程序的灵活性较差，日后较难维护。search4.py的代码就更差了，它包含了一个手写的、无参数的HTTP请求，这个请求的结构是Python完全无法解析的。当然，search4.py也不包含任何可用于解析HTTP响应，或分析可能的网络错误情况所需的实际逻辑。</p>\n\n<p>这说明了一个问题：正确实现网络协议并非易事。因此，应该尽可能地使用标准库或第三方库。在阅读本书剩余章节时，应将这点牢记于心。尤其是在编写网络客户端时，人们总是一不小心就将代码写得过于简单。人们总是倾向于忽略很多可能发生的错误情况，而只处理最可能出现的情况。适当的转义参数也经常被忽略，因为人们总是轻易相信查询字符串永远只会包含简单的字母字符。总而言之，人们经常会编写相当脆弱的代码。在技术上可行的情况下，对与之交互的服务考虑得少之又少。而如果使用一个已经精心实现了协议的第三方库，那么所有可能情况和麻烦的边界条件带来的问题都可迎刃而解。这是因为不同的Python开发者都要使用这个库来完成各种各样的工作，而库的实现者已经发现并知道如何恰当地解决这些问题。</p>\n\n<p>第四点，需要强调的是，高层的网络协议（如用来解析街道地址的谷歌地理编码API）通常都会将其底层网络细节<strong>隐藏</strong>。如果一个人只使用过pygeocoder库，可能永远不会知道URL和HTTP是pygeocoder用来解决这个问题的底层机制！</p>\n\n<p>有一个有趣的问题：Python库是否在底层正确地隐藏了错误？这个问题的答案取决于Python库实现得有多仔细。如果发生了一个网络错误，导致暂时无法访问谷歌，那么是否应该在查询街道地址坐标的代码中抛出一个原始的底层网络异常？是否要将所有的错误转换为包含地理编码语义的高层异常？在阅读本书的过程中，请仔细关注网络异常捕获这一话题，尤其是在强调底层网络通信的章节中。</p>\n\n<p>最后一点，也是在本章剩余部分将进行介绍的：search4.py使用的<code>socket()</code>接口其实并不是查询谷歌涉及的最底层的协议！正如本例中的网络协议构建于原始套接字之上一样，套接字这一抽象其实也基于更底层的协议，只不过这些协议由操作系统管理，而非Python。</p>\n\n<p>下面列出了<code>socket()</code> API层之下的几层。</p>\n\n<ul>\n	<li>传输控制协议（TCP），该层通过发送（可能重发）、接收以及重排称为数据包（packet）的小型网络信息，支持由字节流组成的双向网络会话。</li>\n	<li>网际协议（IP），该层处理不同计算机间数据包的发送。</li>\n	<li>最底层的&ldquo;链路层&rdquo;，该层负责在直接相连的计算机之间发送物理信息，由网络硬件设备组成，如以太网端口和无线网卡。</li>\n</ul>\n\n<p>在本章剩余部分以及第2章和第3章，读者将学习到这些底层的网络协议。在本章中，我们将先从了解IP层开始。之后的章节会介绍UDP和TCP这两个颇为不同的协议如何支持在两台联网的主机应用间进行的两种基本会话类型。</p>\n\n<p>不过在这之前，让我们先来谈谈字节与字符。</p>\n\n<h2>1.6　编码与解码</h2>\n\n<p>Python 3对字符串和底层字节序列做了明显的区分。字节（byte）是计算机网络通信过程中实际传输的二进制数。每个字节由8位二进制数构成，范围从00000000至11111111，转换为十进制整数就是0到255。Python中的字符（character）串则包含了Unicode字符，比如a（Unicode标准中称之为&ldquo;小写拉丁字母A&rdquo;），或者}（右花括号），或者&empty;（空集）。尽管每个Unicode字符均有一个叫作<strong>编码点</strong>（code point）的数字标识符与之对应，我们还是可以将其视为内部实现细节。Python 3对字符的处理相当谨慎，除非使用者主动请求Python对字符和外部可见的实际字节进行相互转化，否则对使用者可见的只有字符。</p>\n\n<p>两者间的相互转化操作有正式的名称。</p>\n\n<p><strong>解码</strong>（decoding）是在应用程序使用字节时发生的。此时需要理解这些字节的意义。试想，当应用程序从文件或网络接收到字节时，程序就像一个一流间谍一样，对通信信道间传输的原始字节进行解密。</p>\n\n<p><strong>编码</strong>（encoding）是程序将字符串对外输出时所实施的过程。此时，应用程序使用某一种数字计算机使用的编码方法将字符串转化为字节。当计算机需要传输或存储符号时，字节才是真正使用的格式。回想一下刚才提到的间谍，它需要将得到的消息传送回去，那么就需要将消息符号转化为某种能够在网络间传输的代码。</p>\n\n<p>使用Python 3操作这两个过程是相当简单的。使用<code>decode()</code>方法将读入的字节串转化为字符串，使用<code>encode()</code>方法对要输出的字符串进行编码。代码清单1-6展示了这一技术。</p>\n\n<blockquote>\n<p><strong>代码清单1-6</strong>　解码输入字节，编码输出字符</p>\n</blockquote>\n\n<pre>\n<code>#!/usr/bin/env python3\n# Foundations of Python Network Programming, Third Edition\n# https://github.com/brandon-rhodes/fopnp/blob/m/py3/chapter01/stringcodes.py\n\nif __name__ == &#39;__main__&#39;:\n    # Translating from the outside world of bytes to Unicode characters.\n    input_bytes = b&#39;\\xff\\xfe4\\x001\\x003\\x00 \\x00i\\x00s\\x00 \\x00i\\x00n\\x00.\\x00&#39;\n    input_characters = input_bytes.decode(&#39;utf-16&#39;)\n    print(repr(input_characters))\n\n    # Translating characters back into bytes before sending them.\n    output_characters = &#39;We copy you down, Eagle.\\n&#39;\n    output_bytes = output_characters.encode(&#39;utf-8&#39;)\n    with open(&#39;eagle.txt&#39;, &#39;wb&#39;) as f:\n        f.write(output_bytes)</code></pre>\n\n<p>本书的示例尝试将字节与字符仔细区分开来。注意在调用两者的<code>repr()</code>方法时的区别：字节串由字母b开始，如<code>b&#39;Hello&#39;</code>；而字符串则没有起始字母，如<code>&#39;world&#39;</code>。为了消除字节串与字符串带来的混淆，Python 3只对字符串类型提供了大量的字符串方法。</p>\n\n<h2>1.7　网际协议</h2>\n\n<p><strong>网络互联</strong>（networking）指的是通过物理链路将多台计算机连接，使之可以相互通信。而<strong>网际互联</strong>（internetworking）指的是将相邻的物理网络相连，使之形成更大的网络系统，比如互联网。但这两者本质上都是允许资源共享的精心设计的机制。</p>\n\n<p>当然，计算机中的各种各样的资源都需要被共享。磁盘、内存以及CPU都由操作系统进行精密的监控，这样一来，计算机中运行的独立程序就可以互不影响地访问这些资源。而网络则是操作系统需要保护的另一资源，这使得程序间进行通信时不会干涉同一网络中正在进行的其他通信会话。</p>\n\n<p>计算机使用诸如以太网卡、无线发送器以及USB端口等物理网络设备进行相互通信。这些设备都经过了精心设计。多个设备可以共享同一物理媒介，比如12块以太网卡可以插入同一个集线器，30块无线网卡可能共享同一无线信道，DSL调制解调器也使用了频域多路复用。这是电气工程中的一个基本概念。这一技术使得我们在打电话时，电子信号不会被线路中的其他模拟信号干扰。</p>\n\n<p>网络设备间进行共享的基本单元是<strong>数据包</strong>（packet）。数据包就像流通的货币一样，只要有需要，就可以交换。一个数据包是一串长度在几字节到几千字节间的字节串，它是网络设备间进行数据传输的基本单元。专用网络也确实存在，尤其是在电信这样的领域，单个字节在进行传输的时候，可能会被分别路由至不同的地方。尽管如此，用于构建现代计算机电子网络的更通用的技术，都建立在数据包这一基本单元之上。</p>\n\n<p>数据包在物理层通常只有两个属性：包含的字节串数据以及目标传输地址。物理数据包的地址一般是一个唯一的标识符，它标识了在计算机传输数据包的过程中，插入同一以太网段的其他网卡或无线信道。网卡负责发送并接收这样的数据包，使得计算机操作系统不用关心网络是如何处理网线、电压以及信号这些细节的。</p>\n\n<p>那么，什么是网际协议呢？</p>\n\n<p><strong>网际协议</strong>（IP）是为全世界通过互联网连接的计算机赋予统一地址系统的一种机制，它使得数据包能够从互联网的一端发送至另一端。理想情况下，网络浏览器无需了解具体使用哪种网络设备来传输数据包，就能够连接上任意一台主机。</p>\n\n<p>Python程序很少直接操作IP这么底层的协议，但是，至少知道它的具体原理还是对我们有所帮助的。</p>\n\n<h2>1.8　IP地址</h2>\n\n<p>IP的最初版本为连接到万维网的每台计算机分配了一个4字节的地址，通常写为4个由句点分隔的十进制数。每个十进制数表示地址的1字节。因此，每个数的范围是0到255。一个传统的4字节IP地址如下所示：</p>\n\n<pre>\n<code>130.207.244.244</code></pre>\n\n<p>由于纯数字表示的地址不便于记忆，人们使用互联网时常常用<strong>主机名</strong>（hostname）来代替IP地址。用户只要键入google.com就可访问谷歌了，不用去了解其背后的过程。其实，它是将主机名解析到了类似于<code>74.125.67.103</code>的地址，计算机实际上是通过互联网将数据包传输到了该地址。</p>\n\n<p>代码清单1-7所示的getname.py脚本展示了一个简单的Python程序。该程序用来向运行程序的操作系统请求解析主机名www.python.org，它支持Linux、Mac OS、Windows或其他任何系统。这个特定的网络服务叫作域名系统（DNS，Domain Name System）。DNS响应主机名查询的过程是相当复杂的，在第4章中我们将对这一内容作更详细的讨论。</p>\n\n<p><strong>代码清单1-7</strong>　将主机名转换为IP地址</p>\n\n<pre>\n<code>#!/usr/bin/env python3\n# Foundations of Python Network Programming, Third Edition\n# https://github.com/brandon-rhodes/fopnp/blob/m/py3/chapter01/getname.py\n\nimport socket\n\nif __name__ == &#39;__main__&#39;:\n    hostname = &#39;www.python.org&#39;\n    addr = socket.gethostbyname(hostname)\n    print(&#39;The IP address of {} is {}&#39;.format(hostname, addr))</code></pre>\n\n<p>到目前为止，读者只需记住以下两件事即可。</p>\n\n<ul>\n	<li>首先，无论一个互联网应用程序看起来多么新奇，实际上IP协议总是使用数字表示的IP地址来作为数据包传输的目标地址。</li>\n	<li>其次，将主机名解析为IP地址这一复杂的细节是由操作系统来处理的。</li>\n</ul>\n\n<p>操作系统倾向于自己处理IP的多数操作细节，而这些细节对用户及Python代码是不可见的。</p>\n\n<p>实际上，如今地址表示的问题比上述简单的4字节机制要复杂一些。因为全球的4字节IP地址已经开始不够用了，人们又部署了一种名为IPv6的扩展地址机制。它允许使用16字节的地址。这样的地址数量相当庞大，可以在很长时间内满足人们的需求。IPv6的写法与4字节IP地址不同，如下所示：</p>\n\n<pre>\n<code>fe80::fcfd:4aff:fecf:ea4e</code></pre>\n\n<p>然而，只要代码从用户处接收IP地址或主机名，然后将它们传递给网络库来处理，那么就可能永远不需要考虑IPv4与IPv6的区别。运行Python代码的操作系统会知道使用的IP版本，并作出相应的解析。</p>\n\n<p>通常情况下，传统的IP地址可以从左往右读：前1~2字节表示某个机构，接下来的字节通常表示目标机器所在的特定子网，最后一个字节将地址细化至该特定的机器或服务。另外，也有一些特殊的IP地址段，它们有着特殊的意义。</p>\n\n<ul>\n	<li><code>127.*.*.*</code>：以127开头的IP地址是特殊的预留地址段，这一地址段由机器上运行的本地应用程序使用。当Web浏览器、FTP客户端或者Python程序连接到这一地址段中的地址时，其实是在与同一机器上的一些其他服务或程序交互。大多数机器只使用这一地址段中的一个地址：<code>127.0.0.1</code>。这个IP地址被普遍使用，表示&ldquo;运行该程序的机器本身&rdquo;，通常可以通过主机名<code>localhost</code>来访问。</li>\n	<li><code>10.*.*.*</code>、<code>172.16-31.*.*</code>、<code>192.168.*.*</code>：这些IP地址段是为<strong>私有子网</strong>（private subnet）预留的。运营互联网的机构保证过：绝不会把这三个地址段中的任何地址分发给运行服务器或服务的实体公司。因此，在连接互联网时，可以确定，这些地址是没有意义的，它们并不对应可连接的任一主机。所以，如果要构建组织内部网络，可以随意使用这些地址来自由分配内部的IP地址，不需让外网访问这些主机。</li>\n</ul>\n\n<p>我们甚至可能会在自己家里看到这些私有地址。无线路由器或DSL调制解调器经常会把某个私有地址段中的IP地址分配给家用电脑和笔记本，这样就可以把所有的网络流量隐藏起来。而网络服务提供商分配给我们使用的则是另一个&ldquo;真正的&rdquo;IP地址。</p>\n\n<h2>1.9　路由</h2>\n\n<p>一旦应用程序请求操作系统向某一特定IP地址发送数据，操作系统就需要决定如何使用该机器连接的某一物理网络来传输数据。这一决定（根据目的IP地址选择将IP数据包发往何处）就叫作<strong>路由</strong>（routing）。</p>\n\n<p>我们在职业生涯中编写的大部分甚至全部Python代码，都将运行在网络边缘上，会有一个网络接口将程序与互联网相连。对于运行这些程序的机器来说，路由决定就变得相当简单。</p>\n\n<ul>\n	<li>如果IP地址形如<code>127.*.*.*</code>，那么操作系统会知道数据包的目的地址是本机上运行的另一个应用程序。这个数据包甚至不会被传送给物理网络设备，而是直接通过操作系统的内部数据复制转交给另一应用程序。</li>\n	<li>如果目的IP地址与本机处于同一子网，那么可以通过简单地检查本地以太网段、无线信道，或是其他任何网络信息来找到目标主机。然后就可以将数据包发送给本地连接的机器。</li>\n	<li>否则，计算机将数据包转发给一台<strong>网关机器</strong>（gateway machine）。这台机器将本地子网连接至互联网，然后再决定将该数据包发往何处。</li>\n</ul>\n\n<p>当然，路由只是在网络边缘的时候才这么容易，因为此时只需要决定是将数据包留在本地网络，还是将其发送到网络的其他部分。可以想象，对于组成互联网骨干网的专用网络设备来说，路由决定要复杂得多。这种情况下，需要使用交换机将整个网络的各子网相连。在交换机中构建、查询并不断更新详细的路由表，以此来获知发送给谷歌的数据包要走哪条线路，发送给亚马逊的要走哪条，发送给本机的又要走哪条。然而，Python应用程序很少运行在互联网骨干路由器上，所以在实际操作中遇到的情况几乎全是之前概括的简单路由情形。</p>\n\n<p>在前面的章节中，本书没有明确介绍计算机如何确定某个IP地址是属于本地子网，还是通过网关连接的外网。同一子网中的所有主机有着相同的IP地址前缀。为了阐释子网的概念，本书在前缀后加上星号来表示地址的可变部分。当然，实际上，操作系统中实现网络栈的具体逻辑并没有将ASCII星号插入到路由表中，而是通过结合IP地址和掩码来表示子网。掩码指出了某主机属于某子网所需的高位比特匹配数。如果读者记得IP地址的每字节表示8位二进制数，那么就能轻松读懂子网的数字表示。如下所示。</p>\n\n<ul>\n	<li><code>127.0.0.0/8</code>：此模式描述了前面所述的预留给本机的IP地址段，该模式指出地址的前8位（1字节）必须与127匹配，余下的24位（3字节）则可以是任意值。</li>\n	<li><code>192.168.0.0/16</code>：此模式匹配了属于<code>192.168</code>私有地址段的任何IP地址，因为它指出前16位必须完全匹配，而这个32位地址的后16位则可以是任意值。</li>\n	<li><code>192.168.5.0/24</code>：这里明确指定了一个特定的独立子网。这可能是整个互联网上最常见的子网掩码。地址的前3字节都被明确指定了，用来匹配属于该子网的IP地址。属于该子网的机器只有最后1字节（最后8位）不同。这就允许有256个不同的地址。通常来说，<code>.0</code>地址用来表示子网名，<code>.255</code>地址则用作&ldquo;广播数据包&rdquo;的目标地址，&ldquo;广播数据包&rdquo;会被发送到子网内的所有主机（下章中将作介绍）。这样，就有254个地址可以随意分配给计算机。<code>.1</code>地址通常用于连接外网的网关，但有些公司和学校也会选择其他地址。</li>\n</ul>\n\n<p>几乎在所有情况下，我们的Python代码都将直接使用主机操作系统提供的功能，去正确地选择数据包路由。这和之前依靠操作系统来将主机名解析至IP地址是一样的。</p>\n\n<h2>1.10　数据包分组</h2>\n\n<p>最后一个值得提及的IP概念是数据包分组。尽管我们认为操作系统的网络栈已经巧妙地对程序成功隐藏了这一复杂的细节，但是，在互联网的历史上，数据包分组还是引发了大量问题。因此，在这里还是要简单地提一下。</p>\n\n<p>IP支持的数据包极大，最大可至64KB，但是构建于IP网络之上的实际网络设备通常并不支持这么大的数据包，所以分组是相当必要的。例如，以太网只支持1500 B的数据包。因此，网络数据包中包含一个表示&ldquo;不分组&rdquo;（DF，Don&#39;t Fragment）的标记，在源计算机与目的计算机之间的某条物理网络无法容纳太大的数据包时，发送者可以通过这个标记选择是否进行分组。</p>\n\n<ul>\n	<li>如果没有设置DF标记，那么表示允许分组。当数据包的大小超过网络能够容纳的上限时，网关能够将其分为多个小数据包，并进行标记，以表示接收方在接受之后需要将这些小数据包重组为原始大数据包。</li>\n	<li>如果设置了DF标记，那么表示不允许分组。此时如果网络无法容纳数据包，将会丢弃该数据包，并发回一条错误信息。错误信息是由一种特殊信号数据包表示的，这种数据包叫作Internet控制报文协议（ICMP，Internet Control Message Protocol）数据包。发送方在收到错误信息后会尝试将信息分割为较小的数据包，然后重发。</li>\n</ul>\n\n<p>DF标记通常无法由Python程序控制，而是由操作系统来设置。粗略地说，系统通常使用的逻辑是这样的：如果正在进行一个由网络间传输的独立数据报组成的UDP会话（见第2章），那么操作系统不会设置DF标记。这样一来，无论需要传输多少数据，所有数据包都能够到达接收方。反之，如果正在进行的是一个TCP会话（见第3章），而TCP会话是由可能多达成百上千的数据包组成的长数据流，那么操作系统将设置DF标记，这样操作系统就可以选择正确的数据包大小，使得TCP会话顺畅进行。如果不这么做的话，数据包会<strong>在途中</strong>被不断分组，从而使得会话较为低效。</p>\n\n<p>一个互联网子网能够接收的最大数据包叫作<strong>最大传输单元</strong>（MTU，Maximum Transmission Unit）。关于MTU，曾经有个很大的问题，给很多互联网用户造成了麻烦。在20世纪90年代，互联网服务提供商（尤其是提供DSL链路的电话公司）开始使用PPPoE。PPPoE协议对IP数据包进行封装，封装后的大小只有1492B，而不是以太网允许的最大容量1500B。这使得很多网站措手不及，因为他们默认使用大小为1500B的数据包。他们还使用了一种错误的安全措施，阻塞了所有的ICMP数据包。结果，他们的服务器无法接收到任何ICMP错误信息，也就不知道那些未经分组的长达1500B的数据包到达客户的DSL链路时无法兼容。</p>\n\n<p>这个问题引起的症状令人崩溃，小文件和网页的访问都没有问题，Telnet和SSH等交互式协议也都正常，原因在于这两种操作发送的数据包都小于1492B。然而，一旦用户尝试下载一个大文件，或者某个Telnet或SSH命令一次性大量输出了好几个屏幕的信息，那么连接就会被冻结并无法响应。</p>\n\n<p>现在已经很少碰到这个问题了，但仍然可以从中看出底层IP特性是如何影响用户的。因此，在编写或调试网络程序时将IP特性牢记于心是大有裨益的。</p>\n\n<h2>1.11　进一步学习IP</h2>\n\n<p>在余下的章节中，我们将开始学习IP层之上的协议，了解Python的程序如何使用各种基于IP的服务来进行不同类型的网络会话。但如果读者对之前概述的IP工作原理兴趣盎然，并想进一步学习，该怎么办呢？</p>\n\n<p>描述IP的官方资源是由IETF发布的RFC（Requests For Comment）文档。RFC文档精确描述了协议的工作原理。RFC的撰写非常仔细。如果配着一杯浓浓的咖啡，花上几个小时的闲暇时间阅读，那么你就会了解到网际协议工作的每个细节。例如，这里给出了定义网际协议的RFC文档。网址为：</p>\n\n<p><a href=\"http://tools.ietf.org/html/rfc791\">http://tools.ietf.org/html/rfc791</a></p>\n\n<p>我们同样可以从维基百科等通用资源上找到对RFC文档的引用，而RFC文档也经常引用其他RFC文档，这些文档会对某个协议及其工作机制有更详尽的描述。</p>\n\n<p>如果想要系统学习IP及运行于IP之上的其他协议，推荐学习由Kevin R. Fall和W. Richard Stevens共同编著的《TCP/IP详解（卷1）：协议（第2版）》。这是一部经典之作，在篇幅允许的情况下，涵盖了协议操作的所有细节，且描述细致。另外，还有其他一些不错的书，有通识性的网络书籍，也有专门介绍IP网络和路由架设的网络配置（这些事情是在工作中甚至在家使用电脑联网时会遇到的）方面的书籍。</p>\n\n<h2>1.12　小结</h2>\n\n<p>除了最基本的网络服务之外，其他所有服务都构建于更基础的网络功能之上。</p>\n\n<p>在本章的开篇，我们介绍了一个栈。TCP/IP协议（将在第3章介绍）仅仅支持在客户端和服务器之间传输字节串。HTTP协议（见第9章）描述了客户端如何通过TCP/IP建立的连接来请求特定的文档，以及服务器如何响应并提供相应的结果。万维网（见第11章）将获取由HTTP托管的文档所需的指令编码为一个特殊的地址，这个地址称为URL。在服务器需要向客户端返回结构化数据时，标准JSON数据格式是最流行的表示返回文档的格式。在这整个复杂的体系之上，谷歌提供了一个地理编码服务。程序员可以构建一个URL用于请求，而谷歌会返回一个描述地理位置的JSON文档。</p>\n\n<p>每当需要在网络上传输文本信息，或将文本信息以字节的方式存储到磁盘等存储设备上时，都要将字符编码为字节。有多种广为使用的方法可以将字符表示为字节。现代互联网最常用的方法是简单而又有限的ASCII编码以及强大而通用的Unicode系统。其中，UTF-8是尤为常见的Unicode编码方法。可以使用Python的<code>decode()</code>将字节串转换为实际字符。<code>encode()</code>方法则可以用于反向的转换。Python 3做了一项尝试，永远不会自动将字节转换为字符串，原因在于要正确完成这一转换操作，就必须事先知道所使用的编码方法，否则只能靠猜。因此，比起Python 2，使用Python 3编写代码时，需要更多地调用<code>decode()</code>和<code>encode()</code>方法。</p>\n\n<p>由于IP网络帮助应用程序传输数据包，网络管理员、设备供应商和操作系统程序员一起协力为单独的机器分配了IP地址，在机器以及路由器上建立了路由表，并配置了域名系统（第4章）以将IP地址和用户可见的域名关联起来。Python程序员应该知道，每个IP数据包在发往目的地址时，都有自己的传输路径。另外，如果一个数据包超过了传输路径上路由器间一跳的大小限制，那么就可能会对这个数据包进行分组。</p>\n\n<p>在大多数应用程序中，有两种使用IP的基本方法。第一种是，将每个数据包视为独立的信息来使用；另一种则是，请求一个被自动分为多个数据包的数据流。这两种协议分别叫作UDP和TCP。它们分别是本书的第2章和第3章要讨论的主题。</p>\n', '19940', 'publish', '7', '0', '2020-03-13 19:38:22', '2020-04-09 18:46:32');
INSERT INTO `book_episode` VALUES ('18', '第 2 章　UDP', '1', null, '90', '2', 'html', '<p>第1章介绍了支持<strong>数据包</strong>（packet）传输的现代网络硬件。数据包表示较短的信息，大小通常不会超过几千字节。那么，在网络浏览器与服务器进行会话或者电子邮件客户端与ISP的邮件服务器进行会话时，这些独立而小型的数据包是如何组合成会话的呢？</p>\n\n<p>IP协议只负责尝试将每个数据包传输至正确的机器。如果两个独立的应用程序要维护一个会话的话，那么还需要两个额外的特性。这两个特性是由IP层以上的协议来提供的。</p>\n\n<ul>\n	<li>需要为两台主机间传送的大量数据包打上标签，这样就可以将表示网页的数据包和用于电子邮件的数据包区分开来，而这两种数据包也可以与该机器正在进行的其他网络会话使用的数据包分隔开。这一过程叫作<strong>多路复用</strong>（multiplexing）。</li>\n	<li>对两台主机间独立传输的数据包流发生的任何错误，都需要进行修复。而丢失的数据包也需要进行重传，直到将其成功发送至目的地址。另外，如果数据包到达时顺序错乱，则要将这些数据包重组回正确的顺序。最后，要丢弃重复的数据包，以保证数据流中的信息没有冗余。提供这些保证的特性叫作<strong>可靠传输</strong>（reliable transport）。</li>\n</ul>\n\n<p>对于使用IP层的两个主要协议，本书专门使用了两章分别加以介绍。</p>\n\n<p>第一个是<strong>用户数据报协议</strong>（UDP），就是本章要介绍的。UDP协议只解决了上述的第一个问题。2.1节将提到，UDP协议提供了一个端口号，用于对目标为同一机器上不同服务的多个数据包进行适当的多路分解。虽然支持了多路复用和分解，但是使用UDP协议的网络程序仍然需要自己处理丢包、重包和包的乱序问题。</p>\n\n<p>第二个是<strong>传输控制协议</strong>（TCP）。TCP解决了上述两个问题。它跟UDP一样，使用了端口号来支持多路复用和分解。除此之外，TCP还保证了数据流的顺序及可靠传输。这样一来，尽管连续的数据流在传输时被分为多个数据包，而后在接收端再进行重组，但是这些细节都对应用层隐藏了。读者将在第3章学习关于TCP的知识。</p>\n\n<p>需要注意的是，有一些专用应用程序在IP网络上进行会话时，既不选择TCP协议，也不选择UDP协议，而是创建一个全新的基于IP的协议来支持新的会话方式。这样的应用程序较少，例如一个在局域网内所有主机间共享的多媒体应用。这种情况不仅很少见，而且也不太可能使用Python来编写进行这种底层操作的程序。所以，本书不会涉及类似的协议实现方面的内容。</p>\n\n<p>不得不坦率承认，我们不太可能在自己的任何一个应用程序中使用UDP。如果认为UDP适用于某个应用，读者不妨了解一下消息队列（见第8章）。不过，对UDP的介绍可以让读者了解原始数据包的多路复用，这在准备学习第3章中TCP相关的知识前是重要的一步。</p>\n\n<h2>2.1　端口号</h2>\n\n<p>在计算机网络和电磁信号理论中，对共享同一通信信道的多个信号进行区分是个常见的问题。<strong>多路复用</strong>（multiplexing）就是允许多个会话共享同一介质或机制的一种解决方案。使用不同的频率来区分无线电信号是一个著名的发现。UDP的设计者从数字领域分析，选用了一种算不上巧妙但是绝对可行的方案来区分不同的会话。该方案为每个UDP数据包分配了一对无符号16位<strong>端口号</strong>（port number），端口号的范围从0到65535。<strong>源端口</strong>（source port）标识了源机器上发送数据包的特定进程或程序，而<strong>目标端口</strong>（destination port）则标识了目标IP地址上进行该会话的特定应用程序。</p>\n\n<p>在IP网络层上，唯一可见的就是向特定主机传输的数据包。</p>\n\n<pre>\n<code>Source IP &rarr; Destination IP</code></pre>\n\n<p>然而，进行通信的两台机器上的网络栈，需要支持多个运行程序互不影响地<strong>同时</strong>进行交互，因此可以同时使用IP地址和端口号来标识源机器及目标机器。这种方法更具有针对性。</p>\n\n<pre>\n<code>Source (IP : port number) &rarr; Destination (IP : port number)</code></pre>\n\n<p>对于同一特定会话中发送的数据包，上述4个值是完全相同的。响应数据包则简单地把源IP地址与目标IP地址调换，把源端口号与目标端口号调换。</p>\n\n<p>让我们具体来解释这一思想。假设要在IP地址为<code>192.168.1.9</code>的机器上架设一台DNS服务器（见第4章）。为了让其他计算机能查找到该服务，服务器需要向操作系统请求使用53号端口的权限。该端口是标准DNS端口，用来接收发送至UDP端口的数据包。如果没有已运行的程序占用这个端口，那么DNS服务器将会得到该端口的使用授权。</p>\n\n<p>在这之后，假设一台IP地址为<code>192.168.1.30</code>的客户机想要查询服务器。客户机会在内存中构造该查询，然后请求操作系统将查询封装为一个UDP数据包并发送。数据包到达目标地址时，目的地址的应用程序需要使用某种方法来识别发送该查询的客户端并返回响应，而客户端并没有显式声明请求端口号，因此操作系统会为该查询随机分配一个端口号。假设本例中随机分配了44137号端口。</p>\n\n<p>因此，该数据包会通过如下所示的方式发送至目标地址的53号端口。</p>\n\n<pre>\n<code>Source (192.168.1.30:44137) &rarr; Destination (192.168.1.9:53）</code></pre>\n\n<p>一旦DNS服务器构造完成了响应信息，就会请求操作系统发送一个UDP数据包作为响应。该数据包中的源目标IP地址和端口与请求数据包正好相反。这样，服务器的响应就能直接发回给请求方了。</p>\n\n<pre>\n<code>Source (192.168.1.9:53) &rarr; Destination (192.168.1.30:44137)</code></pre>\n\n<p>因此，UDP机制其实相当简单。它仅使用IP地址和端口号进行标识，以此将数据包发送至目标地址。</p>\n\n<p>但客户端如何获悉需要连接的端口号呢？要解决这一问题，可以采用下面3个常规方法。</p>\n\n<ul>\n	<li><strong>惯例</strong>：互联网号码分配机构（IANA，Internet Assigned Numbers Authority）为许多专用服务分配了官方的知名端口。因此，在上例中，DNS的默认端口为53号UDP端口。</li>\n	<li><strong>自动配置</strong>：通常情况下，计算机首次连接网络时，会使用DHCP这样的协议来获取一些重要服务的IP地址，比如DNS。应用程序通过将这些IP地址与知名端口号结合，便可访问这些基础服务。</li>\n	<li><strong>手动配置</strong>：除了上述两种情况外，管理员或用户还必须手动配置IP地址或相应的服务域名。从这一意义上来说，每当在网络浏览器中键入服务器名时，实际上都发生了手动配置的对应操作。</li>\n</ul>\n\n<p>IANA为相应的服务定义端口号时，将端口号分为了三大类。这一分类规则对UDP及TCP端口号均适用。</p>\n\n<ul>\n	<li><strong>知名端口</strong>（0~1023）被分配给最重要、最常用的服务。在许多类Unix操作系统上，普通用户程序都是无法监听这些端口的。以前，这一特点可以防止大学里使用多用户计算机的捣蛋鬼学生将一些运行程序伪装成重要的系统服务。时至今日，这一特性还是可以在主机提供公司分发Linux命令行账户时派上用处。</li>\n	<li><strong>注册端口</strong>（1024~49151）在操作系统层上并无任何特别之处。例如，任何用户都可以编写程序占用5432端口，并伪装为一个PostgreSQL数据库服务。然而IANA可以为一些专用服务注册这些端口。因此，IANA建议，只在使用其指定服务时才使用这些端口。</li>\n	<li>其余的端口号（49152~65535）都可以随意使用。接下来，读者将看到，当客户端无需为其提供的服务指定特定端口时，现代操作系统便会从这些端口号组成的端口池中随机选取端口号用于该服务。</li>\n</ul>\n\n<p>当编写程序从命令行或配置文件等用户输入接收端口号时，如果希望程序是更加用户友好的，除了要接收数字表示的端口号外，还应接收可读性较高的知名端口名。这些名字是标准的，可以使用Python标准库<code>socket</code>模块的<code>getservbyname()</code>函数获取。可以使用如下方法查询域名服务的端口号：</p>\n\n<pre>\n<code>&gt;&gt;&gt; import socket\n&gt;&gt;&gt; socket.getservbyname(&#39;domain&#39;)\n53</code></pre>\n\n<p>在第4章中，我们将看到，同样可以使用<code>socket</code>模块提供的一个更复杂的<code>getaddrinfo()</code>函数来解析端口名。</p>\n\n<p>在Linux和Mac OS X机器上，知名服务名与其对应的端口号通常保存在/etc/services文件中。读者有空可详细阅读这一文件。特别的是，该文档的前几页使用的仍然是老版本的协议，其中包含的预留端口号其实早已不再适用。IANA在<a href=\"http://www.iana.org/assignments/port-numbers\">http://www.iana.org/assignments/port-numbers</a>维护了一份最新的在线版本（该版本一般来说要详细得多）。</p>\n\n<h2>2.2　套接字</h2>\n\n<p>在决定如何设计网络编程API时，Python没有重复造轮子，它的处理方法相当有趣。在底层，Python标准库对兼容POSIX操作系统网络操作的底层系统调用进行了封装，并为所有普通的原始调用提供了一个简单的基于对象的接口。封装后的Python函数名与原始系统调用名相同。Python的这种设计使开发者可以使用早已熟知的方法来调用传统系统。因此，20世纪90年代早期，Python令还在使用底层语言挣扎的程序员们眼前一亮。Python这一高级语言发行后，程序员们终于可以在需要时进行底层操作系统调用，而无需使用看似优雅、实则设计拙劣且功能弱小的特定语言API了。Python提供了和C相同的系统调用集合，让使用者更易于记忆。</p>\n\n<p>无论是Windows系统还是POSIX系统（比如Linux和Mac OS X），其网络操作背后的系统调用都是围绕着<strong>套接字</strong>（socket）这一概念来进行的。套接字是一个通信端点，操作系统使用整数来标识套接字，而Python则使用<code>socket.socket</code>对象来更方便地表示套接字。该对象内部维护了操作系统标识套接字的整数（可以调用它的<code>fileno()</code>方法来查看）。每当调用<code>socket.socket</code>对象的方法请求使用该套接字的系统调用时，该对象都会自动使用内部维护的套接字整数标识符。</p>\n\n<blockquote>\n<p><strong>注意</strong>　在POSIX系统中，标识套接字的<code>fileno()</code>整数也是一个文件描述符（file descriptor），可以从表示所有打开文件的整数池中获取。在POSIX环境中编程时可能会遇到一些情况，要使用这一整数来做一些非网络调用。比如，使用文件描述符进行<code>os.read()</code>和<code>os.write()</code>这样的文件操作，这一文件描述符实际上表示的就是套接字。但是，由于本书提供的代码同样支持Windows，因此只会在套接字上进行真正的套接字操作。</p>\n</blockquote>\n\n<p>那么，实际使用中的套接字是什么样的呢？阅读代码清单2-1，该程序展示了一个简单的UDP服务器和UDP客户端。可以看到，这个程序只调用了一次Python标准库的<code>socket.socket()</code>函数，其他所有调用都是通过返回的套接字对象来进行的。</p>\n\n<blockquote>\n<p><strong>代码清单2-1</strong>　使用自环接口的UDP服务器和客户端</p>\n</blockquote>\n\n<pre>\n<code>#!/usr/bin/env python3\n# Foundations of Python Network Programming, Third Edition\n# https://github.com/brandon-rhodes/fopnp/blob/m/py3/chapter02/udp_local.py\n# UDP client and server on localhost\n\nimport argparse, socket\nfrom datetime import datetime\n\nMAX_BYTES = 65535\n\ndef server(port):\n    sock = socket.socket(socket.AF_INET, socket.SOCK_DGRAM)\n    sock.bind((&#39;127.0.0.1&#39;, port))\n    print(&#39;Listening at {}&#39;.format(sock.getsockname()))\n    while True:\n        data, address = sock.recvfrom(MAX_BYTES)\n        text = data.decode(&#39;ascii&#39;)\n        print(&#39;The client at {} says {!r}&#39;.format(address, text))\n        text = &#39;Your data was {} bytes long&#39;.format(len(data))\n        data = text.encode(&#39;ascii&#39;)\n        sock.sendto(data, address)\n\ndef client(port):\n    sock = socket.socket(socket.AF_INET, socket.SOCK_DGRAM)\n    text = &#39;The time is {}&#39;.format(datetime.now())\n    data = text.encode(&#39;ascii&#39;)\n    sock.sendto(data, (&#39;127.0.0.1&#39;, port))\n    print(&#39;The OS assigned me the address {}&#39;.format(sock.getsockname()))\n    data, address = sock.recvfrom(MAX_BYTES) # Danger!\n    text = data.decode(&#39;ascii&#39;)\n    print(&#39;The server {} replied {!r}&#39;.format(address, text))\n\nif __name__ == &#39;__main__&#39;:\n    choices = {&#39;client&#39;: client, &#39;server&#39;: server}\n    parser = argparse.ArgumentParser(description=&#39;Send and receive UDP locally&#39;)\n    parser.add_argument(&#39;role&#39;, choices=choices, help=&#39;which role to play&#39;)\n    parser.add_argument(&#39;-p&#39;, metavar=&#39;PORT&#39;, type=int, default=1060,\n                        help=&#39;UDP port (default 1060)&#39;)\n    args = parser.parse_args()\n    function = choices[args.role]\n    function(args.p)</code></pre>\n\n<p>由于脚本中的服务器和客户端都只使用了本地IP地址，即使计算机没有连接至网络，该脚本也可以成功运行。试试先启动服务器。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_local.py server\nListening at (&#39;127.0.0.1&#39;, 1060)</code></pre>\n</blockquote>\n\n<p>服务器会打印出一行输出，然后等待请求信息。</p>\n\n<p>可以从源代码中看到，服务器启动和运行的过程历经了三步。</p>\n\n<p>首先，服务器使用<code>socket()</code>调用创建了一个空套接字。这个新创建的套接字没有与任何IP地址或端口号绑定，也没有进行任何连接。如果此时就尝试使用其进行任何通信操作，那么将会抛出一个异常。尽管如此，这个套接字还是标记了所属的特定类别：协议族<code>AF_INET</code>以及数据报类型<code>SOCK_DGRAM</code>。<code>SOCK_DGRAM</code>表示在IP网络上使用UDP协议。需要注意的是，<strong>数据报</strong>（datagram）［而不是<strong>数据包</strong>（packet）］是用来表示应用层数据块传输的官方术语。这是因为，操作系统的网络栈并不保证传输线路上的单个数据包实际表示的就是单个数据报。（在接下来的章节中，为了能够衡量最大传输单元，我还是坚持把数据报和数据包看作是一对一的关系。）</p>\n\n<p>接着，这个简单的服务器使用<code>bind()</code>命令请求绑定一个UDP网络地址。可以看到，这个网络地址由简单的Python二元组构成，包含了一个IP地址字符串（稍后将看到，同样可以使用主机名）和一个整型的UDP端口号。如果另一个程序此时已经占用了该UDP端口，将导致服务器脚本无法获取这个端口，那么绑定操作将失败，并抛出一个异常。读者可以试试再运行一个本例的服务器，将看到如下报错信息：</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_local.py server\nTraceback (most recent call last):\n  ...\nOSError: [Errno 98] Address already in use</code></pre>\n</blockquote>\n\n<p>当然，第一次运行服务器的时候，也有较小的可能性会收到这一报错信息。那是因为，UDP端口1060已经被机器上的其他程序占用了。这一现象发生时，我发现为本例选择一个端口号有点儿小麻烦。这一端口号当然得大于1023，否则需要系统管理员权限才能运行该脚本。尽管我挺喜欢这些小例子的，但是我实在不鼓励任何人以管理员权限运行这些脚本！我本来也可以让操作系统来选择端口号（稍后可以看到，对于客户端我就是这么做的），然后让服务器将选择的端口号输出，接着将其作为客户端的命令行参数。但如果这么做的话，就无法演示请求特定端口号的语法了。最后，我考虑使用之前提到的数字较大的临时端口，但是这些端口可能已经被机器上的其他应用程序随机选中并占用了，比如网络浏览器或是SSH客户端。</p>\n\n<p>因此，似乎我的唯一选择就是使用1023以上的保留端口而不是使用那些知名端口。我浏览了一下与这些端口对应的服务列表，并猜测读者没有在运行Python脚本的机器上运行SAP BusinessObjects Polestar。如果运行了的话，那么试试为服务器的<code>-p</code>选项设置一个不同的端口号。</p>\n\n<p>需要注意的是，在Python程序中，始终可以查询套接字目前绑定到的IP地址以及端口。可以使用socket对象的<code>getsockname()</code>方法来获取包含该信息的二元组。</p>\n\n<p>一旦套接字成功绑定，服务器就准备好开始接收请求了！服务器会进入一个循环，不断运行<code>recvfrom()</code>。<code>recvfrom(MAX_BYTES)</code>表示可接收最长为65 535字节的信息，这也是一个UDP数据报可以包含的最大长度。因此，服务器将接收每个数据报的完整内容。在没有收到客户端发送的请求信息前，<code>recvfrom()</code>将永远保持等待。</p>\n\n<p>一旦接收到一个数据报，<code>recvfrom()</code>就会返回两个值。第一个是发送该数据报的客户端地址，第二个是以字节表示的数据报内容。使用Python提供的支持直接将字节转换为字符串，并在控制台中输出，接着向客户端返回一个响应数据报。</p>\n\n<p>好的，让我开始分析客户端代码和运行结果。客户端代码也在代码清单2-1中列出了。</p>\n\n<p>（顺便提一下，本例和书中的一些其他例子一样，将服务器代码和客户端代码放在了同一个程序清单中，并通过主函数的命令行参数来区分调用。我希望这一做法没有给读者造成困惑。我通常更喜欢这一风格，因为这会使得服务器和客户端的逻辑在同一页面上靠得很近，更容易弄清楚服务器代码与客户端代码的对应关系。）</p>\n\n<p>由于服务器仍然在运行，我们打开系统上的另一个命令行窗口，并尝试连续运行两次客户端程序，如下所示：</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_local.py client\nThe OS assigned me the address (&#39;0.0.0.0&#39;, 46056)\nThe server (&#39;127.0.0.1&#39;, 1060) replied &#39;Your data was 46 bytes long&#39;\n$ python udp_local.py client\nThe OS assigned me the address (&#39;0.0.0.0&#39;, 39288)\nThe server (&#39;127.0.0.1&#39;, 1060) replied &#39;Your data was 46 bytes long&#39;</code></pre>\n</blockquote>\n\n<p>切回到运行服务器的命令行窗口，可以看到，对于每条连接，服务器都会输出一条响应信息。</p>\n\n<blockquote>\n<pre>\n<code>The client at (&#39;127.0.0.1&#39;, 46056) says &#39;The time is 2014-06-05 10:34:53.448338&#39;\nThe client at (&#39;127.0.0.1&#39;, 39288) says &#39;The time is 2014-06-05 10:34:54.065836&#39;</code></pre>\n</blockquote>\n\n<p>尽管客户端只有3行网络操作的代码，比服务器代码简单一些，但这里还是引入了两个新概念。客户端的<code>sendto()</code>调用提供了两个信息：要发送的信息和目标地址。这是向服务器发送数据报所必需的唯一调用。当然，如果要进行通信的话，也需要客户端的IP地址和端口号。因此，操作系统对客户端的IP地址和端口号进行了自动分配。可以通过<code>getsockname()</code>调用查看IP地址和端口号。操作系统保证自动分配的客户端端口号是IANA的临时端口号中的一个。（至少在我的笔记本电脑的Linux环境下，该保证是没有问题的。如果使用的是其他操作系统，可能会得到不同的结果。）</p>\n\n<p>不再需要服务器运行时，可以在终端中键入Ctrl+C，将其关闭。</p>\n\n<h3>2.2.1　混杂客户端与垃圾回复</h3>\n\n<p>代码清单2-1所示的客户端程序实际上是相当危险的！重新阅读源代码，可以看到，尽管<code>recvfrom()</code>返回了传入的数据报地址，但是代码没有检查该数据报的源地址，也就没有验证该数据报是否确实是服务器发回的响应。</p>\n\n<p>可以把服务器的响应延迟一段时间，看看这个客户端是否会信任其他应用程序发送的响应。在Windows这样功能稍弱的系统上，如果要模仿一个响应较慢的服务器，可能需要在服务器接收请求和发送响应这两步之间添加一个<code>time.sleep()</code>调用。而在Mac OS X和Linux上就简单多了，只要在创建了套接字并启动服务器后，键入Ctrl+Z就可以暂停服务器。</p>\n\n<p>那么，让我们启动一个新的服务器脚本，然后使用Ctrl+Z将其暂停。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_local.py server\nListening at (&#39;127.0.0.1&#39;, 1060)\n^Z\n[1]  +  9370 suspended  python udp_local.py server\n$</code></pre>\n</blockquote>\n\n<p>如果此时运行客户端，那么客户端会发送数据报，然后挂起等待，直到其收到服务器的响应。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_local.py client\nThe OS assigned me the address (&#39;0.0.0.0&#39;, 39692)</code></pre>\n</blockquote>\n\n<p>假设你现在是一个攻击者，想伪造一个服务器的响应，在服务器返回真实的响应之前先一步发送伪造的数据报。客户端告知操作系统会接收任何数据报，而且没有对响应做任何合理性检查，因此客户端会认为你伪造的响应来自服务器。可以在Python命令提示符中启动一个快速的会话来发送一个这样的数据包。</p>\n\n<blockquote>\n<pre>\n<code>$ python3\nPython 3.4.0 (default, Apr 11 2014, 13:05:18)\n[GCC 4.8.2] on linux\nType &quot;help&quot;, &quot;copyright&quot;, &quot;credits&quot; or &quot;license&quot; for more information.\n&gt;&gt;&gt; import socket\n&gt;&gt;&gt; sock = socket.socket(socket.AF_INET, socket.SOCK_DGRAM)\n&gt;&gt;&gt; sock.sendto(&#39;FAKE&#39;.encode(&#39;ascii&#39;), (&#39;127.0.0.1&#39;, 39692))\n4</code></pre>\n</blockquote>\n\n<p>客户端马上就会结束等待，愉快地把这个第三方的响应看成是服务器的响应。</p>\n\n<blockquote>\n<pre>\n<code>The server (&#39;127.0.0.1&#39;, 37821) replied &#39;FAKE&#39;</code></pre>\n</blockquote>\n\n<p>现在可以键入<code>fg</code>将暂停的服务器恢复并保持运行（服务器现在可以看到等待队列中的客户端数据包，并向已经关闭的客户端套接字发送响应）。按下Ctrl+C，会将服务器正常关闭。</p>\n\n<p>注意，客户端面对任何可以向其发送UDP数据包的终端都是脆弱的。这与中间人攻击不同。中间人攻击是取得了网络控制权后从非法地址发送伪造数据包，这种情况下的通信只能通过加密来保护（见第6章）。而本例中的攻击者不需要有任何特权，其所有操作都是合法的。攻击者发送一个带有合法返回地址的数据包，而这些数据会被客户端成功接收。</p>\n\n<p>像这样不考虑地址是否正确，接收并处理所有收到的数据包的网络监听客户端在技术上叫作<strong>混杂</strong>（promiscuous）客户端。我们有时候会故意使用这样的客户端。比如，进行网络监控的时候，需要监控到达某一接口的所有数据包。但是在本例中，混杂是一个问题。</p>\n\n<p>只有使用编写良好的优秀加密方法，才可以保证程序与正确的服务器进行通信。在无法做到这点时，可以使用两个快速解决方案。第一个方法，设计或使用在请求中包含唯一标识符或请求ID的协议，在响应中重复特定请求的唯一标识符或请求ID。如果响应包含了需要的ID，就表示该响应确实来自服务器。只要ID的取值范围足够大，攻击者就无法在短时间内简单地把所有可能包含正确ID的数据包都发送一遍。这样一来，攻击者虽然知道请求信息，但还是需要构造正确的ID。第二个方法，可以检查响应数据包的地址与请求数据包的地址是否相同（回忆一下，Python中可以使用<code>==</code>来比较元组），也可以使用<code>connect()</code>来阻止其他地址向客户端发送数据包。详细信息请参见接下来的2.2.3节和2.2.4节的内容。</p>\n\n<h3>2.2.2　不可靠性、退避、阻塞和超时</h3>\n\n<p>2.1节中提到的客户端和服务器都是在同一台机器上运行的。客户端和服务器通过自环接口进行通信，而没有使用可能会产生信号故障的物理网卡。因此，数据包事实上是不可能丢失的，我们也无法从代码清单2-1中看出使用UDP的麻烦之处。那么，如果数据包确实可能丢失，代码会变得多复杂呢？</p>\n\n<p>阅读代码清单2-2，该程序中的服务器并未始终响应客户端的请求，而是随机选择，只对收到的一半客户端请求做出响应。这样你就能明白如何编写可靠的客户端代码，从而避免苦苦等待一个实际上已经丢失的网络数据包。</p>\n\n<blockquote>\n<p><strong>代码清单2-2</strong>　运行在不同机器上的UDP服务器与客户端</p>\n</blockquote>\n\n<pre>\n<code>#!/usr/bin/env python3\n# Foundations of Python Network Programming, Third Edition\n# https://github.com/brandon-rhodes/fopnp/blob/m/py3/chapter02/udp_remote.py\n# UDP client and server for talking over the network\n\nimport argparse, random, socket, sys\n\nMAX_BYTES = 65535\n\ndef server(interface, port):\n    sock = socket.socket(socket.AF_INET, socket.SOCK_DGRAM)\n    sock.bind((interface, port))\n    print(&#39;Listening at&#39;, sock.getsockname())\n    while True:\n        data, address = sock.recvfrom(MAX_BYTES)\n        if random.random() &lt; 0.5:\n            print(&#39;Pretending to drop packet from {}&#39;.format(address))\n            continue\n        text = data.decode(&#39;ascii&#39;)\n        print(&#39;The client at {} says {!r}&#39;.format(address, text))\n        message = &#39;Your data was {} bytes long&#39;.format(len(data))\n        sock.sendto(message.encode(&#39;ascii&#39;), address)\n\ndef client(hostname, port):\n    sock = socket.socket(socket.AF_INET, socket.SOCK_DGRAM)\n    hostname = sys.argv[2]\n    sock.connect((hostname, port))\n    print(&#39;Client socket name is {}&#39;.format(sock.getsockname()))\n\n    delay = 0.1 # seconds\n    text = &#39;This is another message&#39;\n    data = text.encode(&#39;ascii&#39;)\n    while True:\n        sock.send(data)\n        print(&#39;Waiting up to {} seconds for a reply&#39;.format(delay))\n        sock.settimeout(delay)\n        try:\n            data = sock.recv(MAX_BYTES)\n        except socket.timeout:\n            delay *= 2 # wait even longer for the next request\n            if delay &gt; 2.0:\n                raise RuntimeError(&#39;I think the server is down&#39;)\n            else:\n                break # we are done, and can stop looping\n\n    print(&#39;The server says {!r}&#39;.format(data.decode(&#39;ascii&#39;)))\n\nif __name__ == &#39;__main__&#39;:\n    choices = {&#39;client&#39;: client, &#39;server&#39;: server}\n    parser = argparse.ArgumentParser(description=&#39;Send and receive UDP,&#39;\n                                     &#39; pretending packets are often dropped&#39;)\n    parser.add_argument(&#39;role&#39;, choices=choices, help=&#39;which role to take&#39;)\n    parser.add_argument(&#39;host&#39;, help=&#39;interface the server listens at;&#39;\n                        &#39;host the client sends to&#39;)\n    parser.add_argument(&#39;-p&#39;, metavar=&#39;PORT&#39;, type=int, default=1060,\n                        help=&#39;UDP port (default 1060)&#39;)\n    args = parser.parse_args()\n    function = choices[args.role]\n    function(args.host, args.p)</code></pre>\n\n<p>在之前的示例程序中，操作系统知道程序只想通过私有的<code>127.0.0.1</code>接口接收来自同一机器上其他进程的数据包，但我们也可以把服务器的IP地址指定为一个空字符串，这样能够使得服务器更为通用。空字符串表示&ldquo;任何本地接口&rdquo;。在我的Linux笔记本电脑上，这表示向操作系统请求IP地址<code>0.0.0.0</code>。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_remote.py server &quot;&quot;\nListening at (&#39;0.0.0.0&#39;, 1060)</code></pre>\n</blockquote>\n\n<p>服务器每次接收到请求时，就会使用<code>random()</code>像抛硬币一样决定是否对该请求做出应答。这样一来，就无需不断运行客户端来等待真正丢包现象的发生了。无论服务器是否做出响应，都会在屏幕上输出一条信息，这样就能跟踪服务器的运行状态了。</p>\n\n<p>那么，如何编写&ldquo;真正&rdquo;的UDP客户端来处理可能的丢包现象呢？</p>\n\n<p>首先，UDP的不可靠性意味着客户端必须在一个循环内发送请求。客户端可以选择永远等待某个请求的响应，也可以在它认为等待&ldquo;太久&rdquo;的时候重新发送另一个请求，而等待多久算&ldquo;太久&rdquo;其实是个有点儿随意的决定。这一选择虽然困难，但是十分必要，因为客户端没有通用的方法来区分下述3种颇为不同的事件。</p>\n\n<ul>\n	<li>响应时间较长，但响应即将传回至客户端。</li>\n	<li>响应或请求在传输过程中丢失了，响应永远无法到达客户端。</li>\n	<li>服务器宕机了，无法对任何客户端请求做出响应。</li>\n</ul>\n\n<p>因此，UDP客户端必须选择一个等待时间。一旦超过这个时间间隔还未收到响应，就重新发送请求。当然，这一做法可能会浪费一些服务器的时间，因为第一个请求的响应可能即将传至客户端，而第二个请求却导致服务器做一些不必要的重复操作。然而，客户端必须在某时刻决定进行重发请求，否则客户端可能会永远等待下去。</p>\n\n<p>由于这一原因，该客户端不会在调用<code>recv()</code>后永久暂停，而是调用了套接字的<code>settimeout()</code>方法。该方法通知操作系统，客户端进行一个套接字操作的最长等待时间是<code>delay</code>秒。一旦等待时间超过<code>delay</code>秒，就会抛出一个<code>socket.timeout</code>异常，<code>recv()</code>调用就会中断。</p>\n\n<p>如果一个调用会等待网络操作完成，那么就说该调用<strong>阻塞</strong>（block）了调用方。<strong>阻塞</strong>这一术语用来描述像<code>recv()</code>这样的调用。只要没有接收到新数据，客户端就会一直等待下去。第7章讨论了服务器架构。在第7章中我们可以渐渐体会到阻塞和非阻塞网络调用间的巨大差别！</p>\n\n<p>本例中的客户端一开始设置的等待时间是0.1秒，这个等待时间是比较适中的。在我的家庭网络中，ping的时间通常是几十毫秒。因此，客户端很少会因为响应在传输途中有些延迟就重发请求。</p>\n\n<p>本例的客户端程序有一个重要特点，那就是对响应超时的处理方法。该程序不会简单地以固定的时间间隔不断重发请求！丢包的主要原因是网络拥塞，比如，有些人会在通过DSL调制解调器上传普通数据的同时上传照片或视频。因此，我们最不想做的事就是不断重发一个可能会丢失的数据包。</p>\n\n<p>鉴于这种情况，该客户端使用了一种叫作<strong>指数退避</strong>（exponential backoff）的技术。通过这一技术，尝试重发数据包的频率会越来越低。由于正在运行的客户端对他们的请求采用了退避策略，因此发送的数据包会渐渐减少。这样，拥塞的网络就有可能在丢弃了一些请求和响应数据包后慢慢地恢复正常。这就是指数退避的重要目的。另外，还有一些更奇妙的指数退避算法，例如以太网使用的算法增加了一定的随机性，使得相互竞争网络资源的两块网卡不太可能使用相同的退避策略。最基本的方法相当简单，就是在每次无法收到响应时将等待时间间隔翻倍。</p>\n\n<p>有一点请注意，如果发送的请求需要200毫秒才能传到服务器，那么这一简单算法每次要将同一请求至少发送两次，因为该算法永远不知道该请求需要超过0.1秒的时间才能传至服务器。如果要编写一个长连接的UDP客户端，那么可以考虑记录最近几次请求完成花费的时间。这样就可以给服务器足够的时间做出响应，然后再进行重发。</p>\n\n<p>运行代码清单2-2的客户端时，请使用一个与前面运行服务器脚本的机器不同的主机名。有时候比较幸运，客户端会马上得到响应。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_remote.py client localhost\nClient socket name is (&#39;127.0.0.1&#39;, 45420)\nWaiting up to 0.1 seconds for a reply\nThe server says &#39;Your data was 23 bytes long&#39;</code></pre>\n</blockquote>\n\n<p>然而很多时候，会发现有一个或者好几个请求无法收到响应，此时客户端就必须进行重发。如果仔细观察这些重发，可以发现屏幕上的输出语句随着等待时间间隔的增加输出得越来越慢，因此我们甚至能够实时观察到指数退避的现象。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_remote.py client localhost\nClient socket name is (&#39;127.0.0.1&#39;, 58414)\nWaiting up to 0.1 seconds for a reply\nWaiting up to 0.2 seconds for a reply\nWaiting up to 0.4 seconds for a reply\nWaiting up to 0.8 seconds for a reply\nThe server says &#39;Your data was 23 bytes long&#39;</code></pre>\n</blockquote>\n\n<p>可以从运行服务器的终端中观察到，客户端观测到的丢包到底是服务器脚本模拟的，还是真正的网络丢包。我在运行前面的测试时，可以从运行服务器的控制台中看到，所有的丢包都是服务器模拟的。</p>\n\n<blockquote>\n<pre>\n<code>Pretending to drop packet from (&#39;192.168.5.10&#39;, 53322)\nPretending to drop packet from (&#39;192.168.5.10&#39;, 53322)\nPretending to drop packet from (&#39;192.168.5.10&#39;, 53322)\nPretending to drop packet from (&#39;192.168.5.10&#39;, 53322)\nThe client at (&#39;192.168.5.10&#39;, 53322) says, &#39;This is another message&#39;</code></pre>\n</blockquote>\n\n<p>那么，如果服务器彻底宕机了呢？不幸的是，我们无法通过UDP判断出究竟是服务器宕机了，还是由于网络状况糟糕导致所有请求或响应都丢失了。当然，我认为我们不应该因为这个问题而抱怨UDP。世界本就如此，毕竟对于无法被观测到的事物和压根不存在的事物，我们是无法区分的！因此，客户端的最佳实践就是在进行了足够多的尝试后放弃。结束服务器进程，然后试试重新运行客户端。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_remote.py client localhost\nClient socket name is (&#39;127.0.0.1&#39;, 58414)\nWaiting up to 0.1 seconds for a reply\nWaiting up to 0.2 seconds for a reply\nWaiting up to 0.4 seconds for a reply\nWaiting up to 0.8 seconds for a reply\nWaiting up to 1.6 seconds for a reply\nTraceback (most recent call last):\n  ...\nsocket.timeout: timed out\n\nThe above exception was the direct cause of the following exception:\n\nTraceback (most recent call last):\n  ...\nRuntimeError: I think the server is down</code></pre>\n</blockquote>\n\n<p>当然，这种策略只在程序执行一些简单任务，并且需要产生输出，或向用户返回一些结果时才有效。如果想要编写全天候运行的守护程序（比如屏幕角落的天气图标，不断从远程UDP服务获取温度和天气预报信息），那么最好让程序不断进行重发。毕竟，台式机或笔记本电脑是可能长时间离线的，因此我们的程序可能需要在连接上天气预报服务器前耐心地等上几小时或几天。</p>\n\n<p>编写需要不断重发数据包的守护程序代码时，可不要严格遵循指数退避的策略，否则延时参数会快速增加到一个较大的数字，比如2小时。在这种情况下，如果只是花上半个小时去咖啡厅喝杯咖啡，程序也不会进行任何重发操作，而计算机实际上可能已经连上网了。相反，我们可以选择一个最大的延时参数，比如5分钟。一旦指数退避使得延时参数增加到了该最大值，就不再增加延时了。这样一来，就算计算机长时间离线，也可以保证上线5分钟后就进行一次重发尝试。</p>\n\n<p>如果操作系统可以向进程发送事件信号（比如重新连接上网络），那么就能够使用更好的方法了，而不需要使用计时器，并猜测重新连接上网络的时间。不过不好意思，这些操作系统相关的方法不在本书的讨论范畴，所以我们现在还是回到UDP，来看看更多UDP相关的问题。</p>\n\n<h3>2.2.3　连接UDP套接字</h3>\n\n<p>2.2.2节中的代码清单2-2还引入了另一个需要解释的新概念。之前已经讨论过关于绑定的内容，包括显式的<code>bind()</code>调用和隐式绑定。显式<code>bind()</code>调用发生在服务器端，用来指定服务器要使用的IP地址和端口；隐式绑定则发生在客户端，当客户端第一次尝试使用一个套接字时，操作系统会为其随机分配一个临时端口。</p>\n\n<p>不过，代码清单2-2所示的远程UDP客户端还使用了一个之前没有讨论过的调用：套接字操作<code>connect()</code>。我们很容易就能看出该调用的功能。如果使用<code>sendto()</code>，那么每次向服务器发送信息的时候都必须显式地给出服务器的IP地址和端口。而如果使用<code>connect()</code>调用，那么操作系统事先就已经知道数据包要发送到的远程地址，这样就可以简单地把要发送的数据作为参数传入<code>send()</code>调用，而无需重复给出服务器地址。</p>\n\n<p>然而<code>connect()</code>的功能可不止于此，只不过我们无法通过阅读代码清单2-2轻易看出<code>connect()</code>的其他重要功能。其实它还解决了客户端的混杂性这一问题！如果使用代码清单2-2的客户端来进行2.2.1节的测试，就会发现客户端不会接收来自其他服务器的数据包。这是使用<code>connect()</code>来配置UDP套接字目标地址的另一个不太明显的效果。一旦运行了<code>connect()</code>，那么只要操作系统发现传入数据包的返回地址与已连接的地址不同，就会将该数据包丢弃。</p>\n\n<p>如果要编写对响应数据包返回地址进行仔细检查的UDP客户端，那么有两种方法。</p>\n\n<ul>\n	<li>可以使用<code>sendto()</code>指定每个数据包的目标地址，然后使用<code>recvfrom()</code>接收响应，并仔细检查响应数据包的返回地址，看看是否曾经向该地址发送过请求。</li>\n	<li>也可以在创建了套接字以后使用<code>connect()</code>将其与目标地址连接，然后使用<code>send()</code>和<code>recv()</code>进行通信。操作系统会将不需要的数据包过滤掉。这种做法只支持同时与一台服务器交互的情况，因为在同一套接字上重复运行<code>connect()</code>不会增加目标地址。反之，它会将之前的地址覆盖，因此程序就不会再收到之前连接的地址发回的响应。</li>\n</ul>\n\n<p>在使用<code>connect()</code>连接了一个UDP套接字之后，可以使用套接字的<code>getpeername()</code>方法得到所连接的地址。如果在一个尚未连接的套接字上调用该方法，那可要小心了。这样做不会返回<code>0.0.0.0</code>或是其他通配符表示的响应。反之，它会抛出一个<code>socket.error</code>。</p>\n\n<p>关于<code>connect()</code>调用，还有最后两点要提一下。</p>\n\n<p>第一点，使用<code>connect()</code>连接UDP套接字，没有在网络上传输任何信息，也没有通知服务器将会收到任何数据包。<code>connect()</code>只是简单地将连接的地址写入操作系统的内存，以供之后调用<code>send()</code>和<code>recv()</code>的时候使用。</p>\n\n<p>第二点，请牢记，使用<code>connect()</code>，甚至通过返回地址手动过滤不需要的数据包，并不能够确保安全！如果网络上确实有恶意的攻击者，那么他们的计算机是很容易伪造出拥有服务器返回地址的数据包的。这样一来，他们伪造的数据包将成功通过我们的地址过滤。</p>\n\n<p>使用另一台计算机的返回地址来发送数据包的行为叫作<strong>电子欺骗</strong>（spoofing）。这也是协议设计者在设计安全协议时需要考虑的首要问题。更多相关信息请参见第6章。</p>\n\n<h3>2.2.4　请求ID：好主意</h3>\n\n<p>代码清单2-1和代码清单2-2中发送的信息都是简单的ASCII文本。不过，如果要自己设计一套UDP请求和响应机制的话，绝对应该考虑给每个请求加上一个序列号，以此保证接收的响应包含相同的序列号。在服务器端，只需把请求的序列号复制到相应的响应中即可。这一做法至少有两大优点。</p>\n\n<p>首先，使用指数退避的客户端会重复发送请求，而请求ID可以帮助我们将响应与重复发送的请求正确地对应起来。</p>\n\n<p>要搞明白重复现象是如何发生的并不困难。我们首先发送了请求A，可是一直没有等到响应，于是重复发送请求A，然后最终收到了响应A。于是，可以认为第一个请求丢失了，然后欣然进行后续的操作。</p>\n\n<p>然而，如果这两个请求都成功发送到了服务器，只不过服务器返回响应的速度比较慢，又会发生什么呢？我们先收到了一个请求的响应，但是否也能很快收到另一个响应呢？如果现在再向服务器发送请求B，并开始监听，立刻就收到了一个响应A。那么响应A到底是之前没收到的请求A的响应，还是刚发送的请求B的响应呢？这时候就弄不清楚了。从这之后，很可能就彻底乱了，无法把响应和请求之间正确地对应起来。</p>\n\n<p>请求ID可以防止这种现象的发生。如果给所有的请求A一个请求ID#42496，给所有的请求B一个请求ID#16916。这样一来，程序中等待请求B响应的循环就只会接收请求ID为#16916的响应，而直接将请求ID不匹配的响应丢弃。这一方法不仅能解决重发请求造成的重复问题，还能解决另一种比较罕见的重复问题：网络结构的冗余偶尔也会在服务器和客户端之间产生同一数据包的两个副本，因此造成的重复问题也可以用请求ID来解决。</p>\n\n<p>使用请求ID也可以解决2.2.1节中提到的问题，因为请求ID至少可以在攻击者无法得到我们的数据包时对电子欺骗起到一点震慑作用。当然，如果攻击者得到了数据包，那就没辙了。他们可以得到每个数据包的IP地址、端口号以及请求ID，然后就能尝试伪造任何他们感兴趣的请求的响应，并发送给客户端了！而我们就只能寄希望于真正服务器的响应能够先一步到达。不过，在攻击者无法观测到我们的通信信息而只能盲目伪造服务器的响应数据包时，一个范围合适的请求ID号可以使得客户端接收伪造响应的可能性大大降低。</p>\n\n<p>可以看到，在上面这个案例里我使用的示例请求ID既不是顺序的，也没那么容易被猜出来。这些特性意味着攻击者无法知晓序列号的特点。如果从0或1开始依次递增序列号，那么攻击者猜测起来就容易多了。反之，可以使用<code>random</code>模块来生成大整数。如果ID号是0~N的一个随机数，那么即使攻击者知道服务器的IP地址和端口，他们能伪造出合法数据包的可能性最多也只有1/N。如果他还要疯狂猜测端口号的话，那么可能性就更低了。</p>\n\n<p>不过，这些仍然都不是真正的安全，只有在攻击者无法获取我们的网络通信信息而只能进行最简单的电子欺骗攻击时才能起到保护作用。真正的安全意味着即使攻击者可以获取通信数据并插入任何信息，我们的客户端仍然能受到保护。在第6章中，我们会讨论如何做到真正的安全。</p>\n\n<h2>2.3　绑定接口</h2>\n\n<p>到目前为止，我们已经知道，服务器在进行<code>bind()</code>调用的时候可以使用两个IP地址。可以使用<code>&#39;127.0.0.1&#39;</code>表示只接收来自本机上其他运行程序的数据包，也可以使用空字符串<code>&#39;&#39;</code>作为通配符，表示可以接收通过该服务器的任何网络接口收到的数据包。</p>\n\n<p>除此之外，还有第三种选择。可以提供该服务器的某一个外部IP接口的IP地址，比如以太网连接或无线网卡，服务器只会监听传输至该IP的数据包。读者可能已经注意到了代码清单2-2实际上是允许我们为<code>bind()</code>调用提供一个表示服务器地址的字符串的。现在我们可以来做些实验。</p>\n\n<p>如果只绑定到一个外部接口会如何呢？如下所示，使用从操作系统获取到的任一外部IP地址运行服务器。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_remote.py server 192.168.5.130\nListening at (&#39;192.168.5.130&#39;, 1060)</code></pre>\n</blockquote>\n\n<p>使用另一台机器应该仍然可以连接到这一IP地址。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_remote.py client guinness\nClient socket name is (&#39;192.168.5.10&#39;, 35084)\nWaiting up to 0.1 seconds for a reply\nThe server says &#39;Your data was 23 bytes&#39;</code></pre>\n</blockquote>\n\n<p>然而，如果尝试在同一台机器上运行客户端脚本，并通过自环接口来连接服务的话，那么服务器永远不会做出响应。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_remote.py client 127.0.0.1\nClient socket name is (&#39;127.0.0.1&#39;, 60251)\nWaiting up to 0.1 seconds for a reply\nTraceback (most recent call last):\n  ...\nsocket.error: [Errno 111] Connection refused</code></pre>\n</blockquote>\n\n<p>事实上，至少在我的操作系统上，这一操作的结果要稍好一些，服务器还是会发送数据包的。由于操作系统会检测是否有打开的端口没有向网络发送数据包，如果有请求发送至该端口，那么操作系统会马上做出响应，通知客户端该连接是不可用的！不过，要知道只有在使用自环接口的时候，UDP才能够返回&ldquo;拒绝连接&rdquo;的响应。如果在真实网络上进行通信，那么客户端发送的数据包无法判断服务器端是否有接受该请求的端口。</p>\n\n<p>试试再次在同一机器上运行客户端。不过这次要使用外部IP地址来连接服务器。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_remote.py client 192.168.5.130\nClient socket name is (&#39;192.168.5.130&#39;, 34919)\nWaiting up to 0.1 seconds for a reply\nThe server says &#39;Your data was 23 bytes&#39;</code></pre>\n</blockquote>\n\n<p>看到了吗？本地的运行程序可以使用任何本机的IP地址向服务器发送请求，即使是使用这个IP地址与本机上的其他服务通信也没有问题。</p>\n\n<p>因此，绑定IP接口可能会限制可以与服务器进行通信的外部主机。不过，只要本机上的其他客户端知道IP地址，那么与服务器的本地通信当然是无法限制的。</p>\n\n<p>如果同时运行两个服务器会如何呢？停止所有正在运行的脚本，试试在同一台机器上运行两个相同的服务器程序。第一个服务器会连接至自环接口。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_remote.py server 127.0.0.1\nListening at (&#39;127.0.0.1&#39;, 1060)</code></pre>\n</blockquote>\n\n<p>由于地址已经被占用，第二个服务器无法再使用这一地址。否则，在该地址收到某个数据包的时候，操作系统就不知道该让哪个服务器进程来处理了。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_remote.py server 127.0.0.1\nTraceback (most recent call last):\n  ...\nOSError: [Errno 98] Address already in use</code></pre>\n</blockquote>\n\n<p>不过有点儿令人惊讶的是，同样不能使用通配符IP地址来运行第二个服务器。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_remote.py server &quot;&quot;\nTraceback (most recent call last):\n  ...\nOSError: [Errno 98] Address already in use</code></pre>\n</blockquote>\n\n<p>无法使用的原因是通配符地址包含了<code>127.0.0.1</code>，与已经被第一个服务器进程占用的地址冲突了。但如果不使用通配符IP地址，而使用第一个服务器进程没有监听的外部IP接口呢？让我们来试试。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_remote.py server 192.168.5.130\nListening at (&#39;192.168.5.130&#39;, 1060)</code></pre>\n</blockquote>\n\n<p>成功了！现在有两个使用相同UDP端口号的服务器在同一机器上运行了。其中一个服务器绑定了内部的自环接口，另一个则监听来自我的无线网卡所连接网络的数据包。如果机器有多个远程接口，那么甚至可以启动更多的服务器，每个服务器监听一个远程接口。</p>\n\n<p>运行这些服务器以后，试试使用UDP客户端向它们发送一些数据包。我们会发现，对于每个请求，它只会被一个服务器接收。该服务器的地址就是对应UDP请求数据包的特定目标地址。</p>\n\n<p>从以上内容中可以学到一点：无论任何时候，IP网络栈都不会把UDP端口看作是一个可以连接或正在使用的单独实体。相反，IP网络栈关注的是UDP&ldquo;套接字名&rdquo;。UDP套接字名是IP接口和UDP端口号组成的二元组（该IP接口也可以是通配符接口）。必须保证这些套接字名在任何时候都不会与正在监听的服务器产生冲突。如果产生冲突的只是UDP端口的话则无伤大雅。</p>\n\n<p>最后，还有一点需要注意。前面的讨论提到了，将服务器绑定到<code>127.0.0.1</code>接口可以防止接收外部网络产生的恶意数据包。读者可能会认为，将服务器绑定到某个外部接口可以防止其接收来自其他外部网络的数据包。例如，在一台拥有多个网卡的大型服务器上，你可能会想把服务器绑定到一个私有子网，并且认为这样就可以阻止发送至该服务器公网IP地址的欺诈数据包。</p>\n\n<p>不过可惜的是，这可没那么容易。发送至某个接口的数据包能否到达另一个接口，实际上取决于操作系统的选择和配置。操作系统可能会欣然接收从网络上其他服务器通过公共网络连接发送来的数据包！查看操作系统的文档或询问系统管理员，具体问题具体分析。如果操作系统无法进行这一保护，那么可以配置运行防火墙来提供保护。</p>\n\n<h2>2.4　UDP分组</h2>\n\n<p>到目前为止，本章一直在讲述用户如何通过UDP发送原始的数据报。这些数据报会被封装成IP数据包，并加入了一点儿附加信息：发送方和接收方的端口。不过，读者可能已经开始对之前的程序示例有点怀疑了，因为程序中的UDP数据包最大可以到64KB，而你可能已经知道以太网或者无线网卡只能处理1500B左右的数据包。</p>\n\n<p>事实上，UDP必须把较大的UDP数据报分为多个较小的数据报，这样就能够以单独IP数据包的形式在网络中发送这些数据报（第1章中做了简要介绍）。这意味着，较大的数据包在传输过程中更易发生丢包现象，因为只要它分隔出的任一小数据包没有传至目标地址，便无法重组出原始的大数据包，正在监听的操作系统也就无法正确接收了。</p>\n\n<p>除了传输更易失败外，对大型UDP数据包进行分组并使之与传输线路兼容的这一过程对应用程序是不可见的。不过在下面3种情况下，两者可能会有一定的关联。</p>\n\n<ul>\n	<li>如果考虑到效率，那么我们可能会对协议做出一些限制，比如，只允许传输小数据包以减少重传的情况，或者限制远程IP栈用于重组UDP数据包并将其传回给等待应用程序的时间。</li>\n	<li>如果运行了防火墙，那么本地主机通常可以自动检测出与远程主机间的MTU。此时，如果防火墙错误地阻止了ICMP数据包（这在20世纪90年代是个很普遍的现象），如果不注意的话，较大的UDP数据包很可能会被遗忘。MTU指&ldquo;最大传输单元&rdquo;或&ldquo;最大数据包容量&rdquo;。两台主机间的所有网络设备都支持MTU。</li>\n</ul>\n\n<p>如果协议可以对如何针对不同的数据报进行数据分割做出选择，而我们又希望能够在两台主机间的实际MTU的基础上自动调整数据包大小，那么可以通过操作系统关闭分组功能。这样一来，在UDP数据包过大时就会收到一条错误信息。然后，我们可以谨慎地修改数据报，使得其大小不超过限制。</p>\n\n<p>Linux就能够支持最后这一选项。阅读代码清单2-3，该程序发送了一个大型数据报。</p>\n\n<blockquote>\n<p><strong>代码清单2-3</strong>　发送大型UDP数据包</p>\n</blockquote>\n\n<pre>\n<code>#!/usr/bin/env python3\n# Foundations of Python Network Programming, Third Edition\n# https://github.com/brandon-rhodes/fopnp/blob/m/py3/chapter02/big_sender.py\n# Send a big UDP datagram to learn the MTU of the network path.\n\nimport IN, argparse, socket\n\nif not hasattr(IN, &#39;IP_MTU&#39;):\n    raise RuntimeError(&#39;cannot perform MTU discovery on this combination&#39;\n                       &#39; of operating system and Python distribution&#39;)\n\ndef send_big_datagram(host, port):\n    sock = socket.socket(socket.AF_INET, socket.SOCK_DGRAM)\n    sock.setsockopt(socket.IPPROTO_IP, IN.IP_MTU_DISCOVER, IN.IP_PMTUDISC_DO)\n    sock.connect((host, port))\n    try:\n        sock.send(b&#39;#&#39; * 65000)\n    except socket.error:\n        print(&#39;Alas, the datagram did not make it&#39;)\n        max_mtu = sock.getsockopt(socket.IPPROTO_IP, IN.IP_MTU)\n        print(&#39;Actual MTU: {}&#39;.format(max_mtu))\n    else:\n        print(&#39;The big datagram was sent!&#39;)\n\nif __name__ == &#39;__main__&#39;:\n    parser = argparse.ArgumentParser(description=&#39;Send UDP packet to get MTU&#39;)\n    parser.add_argument(&#39;host&#39;, help=&#39;the host to which to target the packet&#39;)\n    parser.add_argument(&#39;-p&#39;, metavar=&#39;PORT&#39;, type=int, default=1060,\n                        help=&#39;UDP port (default 1060)&#39;)\n    args = parser.parse_args()\n    send_big_datagram(args.host, args.p)</code></pre>\n\n<p>如果运行该程序，向我家庭网络中的任一服务器发送请求，就会发现，我的无线网络跟常见的以太网一样，只允许发送不超过1500B的物理数据包。</p>\n\n<blockquote>\n<pre>\n<code>$ python big_sender.py guinness\nAlas, the datagram did not make it\nActual MTU: 1500</code></pre>\n</blockquote>\n\n<p>更让人有点儿惊讶的是，虽然我的笔记本电脑的自环接口能够支持跟我的RAM一样大的数据包，但它实际上也设置了MTU。</p>\n\n<blockquote>\n<pre>\n<code>$ python big_sender.py 127.0.0.1\nAlas, the datagram did not make it\nActual MTU: 65535</code></pre>\n</blockquote>\n\n<p>不过，查看MTU这一功能并非处处可用。可以通过操作系统文档查看详细信息。</p>\n\n<h2>2.5　套接字选项</h2>\n\n<p>POSIX的套接字接口提供了各种各样的套接字选项，可以通过这些选项来控制网络套接字的特定行为。代码清单2-3所示的<code>IP_MTU_DISCOVER</code>选项只是冰山一角。我们可以通过<code>getsockopt()</code>和<code>setsockopt()</code>获取并设置套接字选项。可依据操作系统文档列出的套接字选项进行这两个系统调用。在Linux上，试试查看<code>socket(7)</code>、<code>udp(7)</code>和下章将提到的<code>tcp(7)</code>的帮助手册。</p>\n\n<p>设置套接字选项时，首先需要给出其所属选项组的名称，然后还要给出要设置的选项名。可以查询操作系统的帮助手册来获取选项组的名称。和Python的<code>getattr()</code>与<code>setattr()</code>调用一样，设置套接字选项的调用比获取套接字选项的调用多一个参数。</p>\n\n<pre>\n<code>value = s.getsockopt(socket.SOL_SOCKET, socket.SO_BROADCAST)\ns.setsockopt(socket.SOL_SOCKET, socket.SO_BROADCAST, value)</code></pre>\n\n<p>有很多选项是特定操作系统独有的。这些选项的描述可能过于繁琐。下面是几个更通用的选项。</p>\n\n<ul>\n	<li><code>SO_BROADCAST</code>：该选项允许发送并接收UDP广播数据包。2.6节将介绍这一内容。</li>\n	<li><code>SO_DONTROUTE</code>：该选项表示只向本机直接连接的子网内的主机发送数据包。例如，如果在我的笔记本上设置了这个套接字选项，那么现在它可以向<code>127.0.0.0/8</code>和<code>192.168.5.0/24</code>这两个网络的主机发送数据包，但是无法将这些数据包发送给别的地址。因为发往别处的数据包必须通过网关进行路由，而设置<code>SO_DONTROUTE</code>选项会导致数据包不经由网关发送。</li>\n	<li><code>SO_TYPE</code>：将该选项传给<code>getsockopt()</code>时，会返回套接字类型，可以从中得知使用的是用于UDP的<code>SOCK_DGRAM</code>类型还是支持TCP语义的<code>SOCK_STREAM</code>类型（见第3章）。</li>\n</ul>\n\n<p>下章将介绍一些TCP套接字专有的套接字选项。</p>\n\n<h2>2.6　广播</h2>\n\n<p>如果说UDP有什么功能特别强大的话，那就是对广播的支持了。通过广播，可以将数据报的目标地址设置为本机连接的整个子网，然后使用物理网卡将数据报广播，这样就无需再复制该数据包并单独将其发送给所有连接至该子网的主机了。</p>\n\n<p>必须要马上提一下的是，由于出现了一种更为复杂的叫作<strong>多播</strong>（multicast）的技术，广播如今已经被认为是过时的了。通过多播，现代操作系统能够更好地利用网络及网络接口设备提供的许多智能信息。另外，多播能够支持非本地子网上的主机。不过，如果想用一种简单的方法在本地LAN上完成一些允许偶尔丢包的功能（比如游戏客户端或是自动实时记分牌）的话，UDP广播是个简单易行的选择。</p>\n\n<p>代码清单2-4的示例中，有一个接收广播数据包的服务器和一个发送广播数据包的客户端。如果仔细观察，可以发现本例使用的技术与之前的例子只在一点上有所不同：在使用套接字对象时，先调用<code>setsockopt()</code>方法，设置为允许进行广播。除此之外，服务器和客户端使用套接字的方法都与平常无异。</p>\n\n<blockquote>\n<p><strong>代码清单2-4</strong>　UDP广播</p>\n</blockquote>\n\n<pre>\n<code>#!/usr/bin/env python3\n# Foundations of Python Network Programming, Third Edition\n# https://github.com/brandon-rhodes/fopnp/blob/m/py3/chapter02/udp_broadcast.py\n# UDP client and server for broadcast messages on a local LAN\n\nimport argparse, socket\n\nBUFSIZE = 65535\n\ndef server(interface, port):\n    sock = socket.socket(socket.AF_INET, socket.SOCK_DGRAM)\n    sock.bind((interface, port))\n    print(&#39;Listening for datagrams at {}&#39;.format(sock.getsockname()))\n    while True:\n        data, address = sock.recvfrom(BUFSIZE)\n        text = data.decode(&#39;ascii&#39;)\n        print(&#39;The client at {} says: {!r}&#39;.format(address, text))\n\ndef client(network, port):\n    sock = socket.socket(socket.AF_INET, socket.SOCK_DGRAM)\n    sock.setsockopt(socket.SOL_SOCKET, socket.SO_BROADCAST, 1)\n    text = &#39;Broadcast datagram!&#39;\n    sock.sendto(text.encode(&#39;ascii&#39;), (network, port))\n\nif __name__ == &#39;__main__&#39;:\n    choices = {&#39;client&#39;: client, &#39;server&#39;: server}\n    parser = argparse.ArgumentParser(description=&#39;Send, receive UDP broadcast&#39;)\n    parser.add_argument(&#39;role&#39;, choices=choices, help=&#39;which role to take&#39;)\n    parser.add_argument(&#39;host&#39;, help=&#39;interface the server listens at;&#39;\n                        &#39; network the client sends to&#39;)\n    parser.add_argument(&#39;-p&#39;, metavar=&#39;port&#39;, type=int, default=1060,\n                        help=&#39;UDP port (default 1060)&#39;)\n    args = parser.parse_args()\n    function = choices[args.role]\n    function(args.host, args.p)</code></pre>\n\n<p>运行本例的服务器和客户端时，首先注意到的是，如果只是使用客户端向一个特定服务器的IP地址发送数据包的话，那么效果和普通的客户端与服务器是完全相同的。设置允许对UDP数据包进行广播并不会禁用或是改变其发送与接收特定地址数据包的正常功能。</p>\n\n<p>如果查看了本地网络的设置，并使用&ldquo;广播地址&rdquo;IP作为客户端目标地址的话，就能看到广播的效果了。首先，使用如下命令运行一到两台网络中的服务器。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_broadcast.py server &quot;&quot;\nListening for datagrams at (&#39;0.0.0.0&#39;, 1060)</code></pre>\n</blockquote>\n\n<p>然后，在这些服务器运行期间，先使用客户端向每个服务器发送信息。可以看到，每条信息都只有一个服务器能够收到。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_broadcast.py client 192.168.5.10</code></pre>\n</blockquote>\n\n<p>不过，使用本地网络的广播地址时，就会突然发现，所有服务器都能同时收到数据包了！（但是没有设置允许广播的普通服务器是无法收到的，请运行多个普通的udp_remote.py服务器进行确认。）此时，在我的本地网络上使用<code>ifconfig</code>命令，可以得知广播地址如下：</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_broadcast.py client 192.168.5.255</code></pre>\n</blockquote>\n\n<p>可以确定，所有服务器都立刻表示收到了信息。如果通过操作系统获取广播地址有点儿困难，并且又不介意向本机的所有网络端口进行广播的话，可以使用Python的特殊主机名<code>&#39;&lt;broadcast&gt;&#39;</code>来发送UDP数据包。将该主机名传给客户端时要小心进行引用，因为<code>&lt;</code>和<code>&gt;</code>符号对于任意普通POSIX shell来说都是特殊字符。</p>\n\n<blockquote>\n<pre>\n<code>$ python udp_broadcast.py client &quot;&lt;broadcast&gt;&quot;</code></pre>\n</blockquote>\n\n<p>要是还有别的平台相关的方法能用于获取连接的每个子网的广播地址，我一定会介绍的。不过可惜的是，如果读者不想仅仅止步于<code>&#39;&lt;broadcast&gt;&#39;</code>这一特殊字符串的使用，就必须要查阅操作系统的文档。</p>\n\n<h3>何时使用UDP</h3>\n\n<p>读者可能会认为UDP在发送小型信息时会很高效。实际上，只有在每次只发送一条信息然后等待响应的时候，UDP才是高效的。如果应用程序会一口气发送多条信息，那么使用&Oslash;MQ这样的智能消息队列实际上效率会更高。原因在于消息队列会设置一个较短的定时器，把多条小型信息包装到一起进行传输。这样的消息队列可能会使用TCP连接来传输消息。TCP对传输负载进行分组的方式相比我们之前的做法更有效率。</p>\n\n<p>不过，UDP在一些情况下还是有其可取之处的。</p>\n\n<ul>\n	<li>要实现一个已经使用了UDP的协议。</li>\n	<li>要设计对时间要求十分严苛的媒体流。媒体流的冗余性允许偶尔发生丢包现象，但是绝不希望数据由于要等待几秒钟前发出却还没到达目标地址的数据响应而阻塞（TCP就会这么做）。</li>\n	<li>要设计适用LAN子网多播的应用程序。LAN子网多播并不可靠，而UDP可以完美支持这一模式。</li>\n</ul>\n\n<p>除了这3种情况之外，我们可能需要阅读本书之后的章节来寻找如何让应用程序进行通信的灵感。老话说得好，当我们发现有一种UDP协议能够适用于应用程序时，我们很可能已经重新实现了TCP。不过，实现得很糟糕。</p>\n\n<h2>2.7　小结</h2>\n\n<p>用户数据报协议使得用户级程序能够在IP网络中发送独立的数据包。通常情况下，客户端程序向服务器发送一个数据包，而服务器通过每个UDP数据包中包含的返回地址发送响应数据包。</p>\n\n<p>POSIX网络栈让我们能够通过&ldquo;套接字&rdquo;的概念来操作UDP。套接字是一个通信端点，给出了IP地址和UDP端口号。IP地址和UDP端口的二元组叫作套接字的<strong>名字</strong>（name）或<strong>地址</strong>（address），可以用来发送与接收数据报。Python通过内置的<code>socket</code>模块提供了这些网络操作原语。</p>\n\n<p>服务器在接收数据包时需要使用<code>bind()</code>绑定一个IP地址和端口。由于操作系统会自动为客户端的UDP程序选择一个端口号，客户端的UDP程序可以直接发送数据包。</p>\n\n<p>UDP建立在网络数据包的基础上，因此它是不可靠的。丢包现象发生的原因可能是网络传输媒介的故障，也可能是某个网段过于繁忙。因此，客户端需要弥补UDP的不可靠性，不断重发请求直至收到响应为止。为了不使繁忙的网络情况变得更糟，客户端应该在重复传输失败时使用指数退避。如果请求往返于服务器和客户端之间的时间超过了最初设置的等待时间，那么应该延长该等待时间。</p>\n\n<p>请求ID是解决重复响应问题的重要利器。重复响应问题指的是，我们收到所有数据包后，又收到了一个被认为已经丢失的响应。此时可能会把该响应误认为是当前请求的响应。如果随机选择请求ID的话，就可以预防最简单的电子欺诈攻击。</p>\n\n<p>使用套接字时有一点至关重要，那就是区分<strong>绑定</strong>（binding）和客户端的<strong>连接</strong>（connecting）这两个行为。绑定指定了要使用的特定UDP端口，而连接限制了客户端可以接收的响应，表示只接收从正在连接的特定服务器发来的数据包。</p>\n\n<p>在可用于UDP套接字的套接字选项中，功能最强大的就是广播。使用广播可以一次向子网内的所有主机发送数据包，而无需向每台主机单独发送。这在编写本地LAN游戏或其他协作计算程序时是很有用的。这也是在编写新应用程序时选用UDP的原因之一。</p>\n', '27392', 'publish', '7', '0', '2020-04-06 18:03:12', '2020-04-06 19:34:40');
