INSERT INTO `book_metadata` VALUES ('9', 'Python 网络编程', 'reference-data:RDs9J5OH7w-DGWAQJV_', '本书针对想要深入理解使用Python来解决网络相关问题或是构建网络应用程序的技术人员，结合实例讲解了网络协议、网络数据及错误、电子邮件、服务器架构和HTTP及Web应用程序等经典话题。具体内容包括：全面介绍Python3提供的SSL支持，异步I/O循环的编写，用Flask框架在Python代码中配置URL，跨站脚本以及跨站请求伪造攻击网站的原理', '100', 'sdfsa', '0');
