INSERT INTO `book_metadata` VALUES ('25', '天坑宝藏', 'reference-data:RDGUdrmoY3csh6gvnHL', '想当年，金王马殿臣富可敌国、威震一方，但直到遁入天坑避世，仍有一件心事难了，那就是未能手刃他的死对头血蘑菇。马殿臣对血蘑菇恨得牙根儿痒痒，却不知血蘑菇的不仁、不义、不忠、不孝，皆因此人打在娘胎里就被逼到了绝路上。世人都说血蘑菇良心丧尽、死有余辜，连他自己也觉得自己是个逮谁坑谁的丧门星，七灾八难全让他赶上了。血蘑菇眼瞧马殿臣带着无数宝藏消失得无影无踪，更觉得自己要逆天改命，和这不公的老天分个你死我活！', '0', '天下霸唱', '0');
INSERT INTO `book_metadata` VALUES ('26', '此生未完成', 'reference-data:RDzutU9yQTNlDpo2LWr', '这是一本记录关于生命与生活思索的书，写给内心柔软却迷路人间的你：我们要用多大的代价，才能认清活着的意义！一再提醒我们的，就是好好把握当下，以不会令自己将来后悔的方式去生活。', '0', '于娟', '0');
INSERT INTO `book_metadata` VALUES ('27', '盛世春光', 'reference-data:RD1i8Of-14yKu1lq7qI', '章霄宇有两大心愿。查出二十年前母亲失踪真相，推广喜欢的紫砂壶。\n遇到唐缈后，他有了第三个心愿：将她珍藏于心。', '0', '桩桩', '0');
INSERT INTO `book_metadata` VALUES ('28', '永久记录', 'reference-data:RDCqCojb4FpFRVn9uFb', '这是斯诺登本人迄今最为详尽的一本自传型回忆录，记录了斯诺登从童年、青春期到成年等不同时期的经历以及价值观的一步步变化，从而让读者看到现代电脑网络科技的发展以及作者对于美国政府监视的不安与良心告白。\n本书从斯诺登的童年回忆开始讲述，自小开始对电脑程序语言产生浓厚的兴趣和由此在电脑世界中产生的绝对控制权，使其逐渐开始研究和寻找网络的秘密，几次黑客任务让其逐渐显露锋芒。虽然在网络世界中如鱼得水，但斯诺登和许多美国少年一样，有着来自于父母、生活、学业考试的困扰。', '0', '【美】爱德华·斯诺登,萧美惠,郑胜得', '0');
INSERT INTO `book_metadata` VALUES ('29', '人类简史：从动物到上帝（精装版）', 'reference-data:RDlY1-oqRIC8qWFlHc6', '几十万年前，地球上至少有6种不同的人种，但今天为什么只剩下智人；从原始洞穴走出到登上月球，从学会使用语言和文字到用互联网把整个世界联结起来，人类是如何一步步登上生物链的顶端，成为地球主宰的？', '0', '【以色列】尤瓦尔·赫拉利,林俊宏', '0');
INSERT INTO `book_metadata` VALUES ('30', '枪炮、病菌与钢铁', 'reference-data:RDv5riVqwAhPMX8Hu5C', '在《枪炮、病菌与钢铁》中，演化生物学家、人类学家贾雷德·戴蒙德揭示了事实上有助于形成历史最广泛模式的环境因素，从而以震撼人心的力量摧毁了以种族主义为基础的人类史理论。', '0', '【美】贾雷德·戴蒙德', '0');
INSERT INTO `book_metadata` VALUES ('31', '如何有效阅读一本书', 'reference-data:RDHjdBuc05w62IUqb9L', '对在漫长人生中读过的书而言，人类的记忆力是有限的。如果想在读完每一本书后都有扎实的收获，就需要有技巧地写读书笔记，并养成长期的习惯。', '0', '【日】奥野宣之,张晶晶', '0');
