INSERT INTO `book_notes` VALUES ('1', '7', '17', '很多情况下，网络编程就是选择并使用一个已经支持所需网络操作的库的过程', 'plaintext', '我们也应该不会从TCP层面开始。', 'div[2]/p[6]/text()[1]', '0', 'div[2]/p[6]/text()[1]', '34', '2020-03-30 22:53:30', '2020-03-30 22:53:30', '0', '1');
INSERT INTO `book_notes` VALUES ('2', '7', '17', 'TCP/IP协议（将在第3章介绍）仅仅支持在客户端和服务器之间传输字节串。HTTP协议（见第9章）描述了客户端如何通过TCP/IP建立的连接来请求特定的文档，以及服务器如何响应并提供相应的结果。', 'plaintext', 'TCP/IP协议介绍', 'div[2]/p[106]/text()[1]', '16', 'div[2]/p[106]/text()[1]', '113', '2020-04-10 01:59:00', '2020-04-10 01:59:00', '0', '1');
INSERT INTO `book_notes` VALUES ('3', '7', '17', 'Python包的安装令人厌恶，并且不可逆', 'plaintext', '没有工具，只要装一次都会无语把。', 'div[2]/p[18]/text()[1]', '3', 'div[2]/p[18]/text()[1]', '23', '2020-04-10 02:02:26', '2020-04-10 02:02:26', '0', '1');
INSERT INTO `book_notes` VALUES ('4', '7', '17', '套接字', 'plaintext', 'Socket', 'div[2]/p[47]/text()[4]', '17', 'div[2]/p[47]/text()[4]', '20', '2020-04-10 22:48:25', '2020-04-10 22:48:25', '0', '1');
INSERT INTO `book_notes` VALUES ('5', '7', '17', '本书会从应用开发者的角度来介绍网络：一是从实现一个网络连接服务的角度，例如网站、邮箱服务器或者网络游戏；二是从编写使用服务的客户端程序的角度。', 'plaintext', '好角度', 'div[2]/p[3]/text()[1]', '66', 'div[2]/p[3]/text()[1]', '137', '2020-04-12 04:01:35', '2020-04-12 04:01:35', '0', '1');
INSERT INTO `book_notes` VALUES ('6', '7', '17', '优雅的pygeocoder接口背后的原理是怎样的呢？网络服务是如何工作的呢？', 'plaintext', '由表面到深入。', 'div[2]/p[29]/text()[1]', '37', 'div[2]/p[29]/text()[1]', '75', '2020-04-12 04:08:47', '2020-04-12 04:08:47', '0', '1');
