INSERT INTO `book_notes` VALUES ('11', '7', '17', '谷歌提供的地理编码API就能够完成这种从物理地址到经纬度的转化', 'plaintext', '厉害', 'div[2]/p[8]/text()[1]', '19', 'div[2]/p[8]/text()[1]', '50', '2020-04-12 04:28:09', '2020-04-12 04:28:09', '0', '32908');
