INSERT INTO `book_notes` VALUES ('15', '7', '17', '你会发现90%的编程挑战就是这么解决的', 'plaintext', '确实是这样的', 'div[2]/p[28]/text()[1]', '90', 'div[2]/p[28]/text()[1]', '109', '2020-04-12 04:46:10', '2020-04-12 04:46:10', '0', '32908');
INSERT INTO `book_notes` VALUES ('16', '7', '17', '正确实现网络协议并非易事。因此，应该尽可能地使用标准库或第三方库。在阅读本书剩余章节时，应将这点牢记于心。尤其是在编写网络客户端时，人们总是一不小心就将代码写得过于简单。人们总是倾向于忽略很多可能发生的错误情况，', 'plaintext', '啊啦啦啦啦啦', 'div[2]/p[58]/text()[1]', '9', 'div[2]/p[58]/text()[1]', '115', '2020-04-12 04:48:20', '2020-04-12 04:48:20', '0', '32908');
