INSERT INTO `category` VALUES ('36', '武侠小说', '武侠小说是中国旧通俗小说的一种重要类型，多以侠客和义士为主人公，描写他们身怀绝技、见义勇为和叛逆造反行为。\n中国第一部具有真正意义的长篇武侠小说《三侠五义》，后世武侠小说有广义和狭义之分，广义上是指传统武侠、浪子异侠、历史武侠、谐趣武侠。', null, null, 'category', '0');
INSERT INTO `category` VALUES ('37', '散文随笔', '随笔散文同记事散文、抒情散文相比，更为自由灵活，往往是随兴而生，有感而发，它并不集中记叙某人某事，也并非倾尽笔力抒发主观情感。随笔散文不拘一格，或记叙、或议论、或抒情，行文自如、随意。', null, null, 'category', '0');
INSERT INTO `category` VALUES ('38', '现言', '现言指的是【现】代背景的【言】情小说', null, null, 'category', '0');
INSERT INTO `category` VALUES ('39', '人物传记', '人物传记是通过对典型人物的生平、生活、精神等领域进行系统描述、介绍的一种文学作品形式。作品要求“真、信、活”，以达到对人物特征和深层精神的表达和反映。人物传记是人物或人物资料的有效记录形式，对历史和时代的变迁等方面的研究具有重要意义。', null, null, 'category', '0');
INSERT INTO `category` VALUES ('40', '社会学', '社会学是系统地研究社会行为与人类群体的学科，起源于19世纪三四十年代，是从社会哲学演化出来的一门现代学科。社会学是一门具有多重研究方式的学科。社会学主要涉及科学主义实证论的定量方法和人文主义的理解方法，它们相互对立相互联系，共同发展及完善一套有关人类社会结构及活动的知识体系，并以运用这些知识去寻求或改善社会福利为主要目标。', null, null, 'category', '0');
